public class Solution {
    public int largestIsland(int[][] grid) {
        int n = grid.length;
        int islandId = 2;
        HashMap<Integer, Integer> islandSize = new HashMap<>();
        int maxIslandSize = 0;

        // Find all islands and calculate their sizes
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 1) {
                    int size = dfs(grid, i, j, islandId);
                    islandSize.put(islandId, size);
                    maxIslandSize = Math.max(maxIslandSize, size);
                    islandId++;
                }
            }
        }

        // Check for 0s and try to connect adjacent islands
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 0) {
                    HashSet<Integer> adjacentIslands = new HashSet<>();
                    if (i > 0 && grid[i - 1][j] != 0) {
                        adjacentIslands.add(grid[i - 1][j]);
                    }
                    if (i < n - 1 && grid[i + 1][j] != 0) {
                        adjacentIslands.add(grid[i + 1][j]);
                    }
                    if (j > 0 && grid[i][j - 1] != 0) {
                        adjacentIslands.add(grid[i][j - 1]);
                    }
                    if (j < n - 1 && grid[i][j + 1] != 0) {
                        adjacentIslands.add(grid[i][j + 1]);
                    }

                    int newIslandSize = 1;
                    for (int island : adjacentIslands) {
                        newIslandSize += islandSize.get(island);
                    }
                    maxIslandSize = Math.max(maxIslandSize, newIslandSize);
                }
            }
        }

        return maxIslandSize;
    }

    private int dfs(int[][] grid, int i, int j, int islandId) {
        int n = grid.length;
        if (i < 0 || i >= n || j < 0 || j >= n || grid[i][j] != 1) {
            return 0;
        }

        grid[i][j] = islandId;
        return 1 + dfs(grid, i + 1, j, islandId) +
                dfs(grid, i - 1, j, islandId) +
                dfs(grid, i, j + 1, islandId) +
                dfs(grid, i, j - 1, islandId);
    }
}

