public class Solution {
    /**
     * There are n cars going to the same destination along a one-lane road.
     * The destination is target miles away.
     * You are given two integer array position and speed, both of length n, where position[i] is the position of the <code>i<sup>th</sup></code> car and speed[i] is the speed of the <code>i<sup>th</sup></code> car (in miles per hour).
     * A car can never pass another car ahead of it, but it can catch up to it and drive bumper to bumper at the same speed.
     * The faster car will slow down to match the slower car's speed.
     * The distance between these two cars is ignored (i.e., they are assumed to have the same position).
     * A car fleet is some non-empty set of cars driving at the same position and same speed.
     * Note that a single car is also a car fleet.
     * If a car catches up to a car fleet right at the destination point, it will still be considered as one car fleet.
     * Return the number of car fleets that will arrive at the destination.
     *
     * @param position the positions of the cars
     * @param speed   the speeds of the cars
     * @return the number of car fleets that will arrive at the destination
     */
    public int carFleet(int[] position, int[] speed) {
        int n = position.length;
        if (n == 0) {
            return 0;
        }

        // Create a list of cars, where each car is represented by its position and speed.
        List<Car> cars = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            cars.add(new Car(position[i], speed[i]));
        }

        // Sort the cars in descending order of position.
        cars.sort(Comparator.comparingInt(Car::getPosition).reversed());

        // Create a stack to store the car fleets.
        List<Double> fleets = new ArrayList<>();

        // Iterate over the cars and create the car fleets.
        double currentTime = 0.0;
        for (Car car : cars) {
            double timeToReachDestination = (double) (car.getPosition() - 0) / (double) car.getSpeed();
            if (fleets.isEmpty() || timeToReachDestination > fleets.get(fleets.size() - 1)) {
                fleets.add(timeToReachDestination);
            } else {
                // The car will catch up to the previous fleet.
            }
        }

        return fleets.size();
    }

    private static class Car {
        private int position;
        private int speed;

        public Car(int position, int speed) {
            this.position = position;
            this.speed = speed;
        }

        public int getPosition() {
            return position;
        }

        public int getSpeed() {
            return speed;
        }
    }
}

