public class Solution {
    public int[] shortestToChar(String s, char c) {
        int n = s.length();
        int[] result = new int[n];
        int pos = -n;

        for (int i = 0; i < n; i++) {
            if (s.charAt(i) == c) {
                pos = i;
            }
            result[i] = i - pos;
        }

        pos = n;
        for (int i = n - 1; i >= 0; i--) {
            if (s.charAt(i) == c) {
                pos = i;
            }
            result[i] = Math.min(result[i], Math.abs(i - pos));
        }

        return result;
    }
}

