public class Solution {
    public int profitableSchemes(int n, int minProfit, int[] group, int[] profit) {
        int MOD = 1000000007;
        int m = group.length;

        // dp[i][j] represents the number of schemes with profit >= j using the first i crimes and at most n members
        long[][] dp = new long[m + 1][minProfit + 1];

        // Base case: no crimes, profit is 0, there's one scheme (doing nothing)
        dp[0][0] = 1;

        for (int i = 1; i <= m; i++) {
            for (int j = 0; j <= minProfit; j++) {
                // Option 1: Don't include the current crime
                dp[i][j] = dp[i - 1][j];

                // Option 2: Include the current crime if possible
                if (group[i - 1] <= n) {
                    int remainingMembers = n - group[i - 1];
                    int newProfit = j - profit[i - 1];

                    if (newProfit >= 0) {
                        dp[i][j] = (dp[i][j] + dp[i - 1][newProfit]) % MOD;
                    } else {
                        dp[i][j] = (dp[i][j] + dp[i - 1][0]) % MOD;
                    }
                }
            }
        }

        long result = 0;
        for (int j = minProfit; j <= m; j++) {
            result = (result + dp[m][j]) % MOD;
        }

        return (int) result;
    }
}

