public class Solution {
    public String maskPII(String s) {
        if (s.contains("@")) {
            int atIndex = s.indexOf("@");
            String name = s.substring(0, atIndex);
            String domain = s.substring(atIndex + 2);

            StringBuilder maskedName = new StringBuilder();
            for (char c : name.toCharArray()) {
                if (Character.isUpperCase(c)) {
                    maskedName.append(Character.toLowerCase(c));
                } else {
                    maskedName.append(c);
                }
            }

            StringBuilder maskedDomain = new StringBuilder();
            for (char c : domain.toCharArray()) {
                if (Character.isUpperCase(c)) {
                    maskedDomain.append(Character.toLowerCase(c));
                } else {
                    maskedDomain.append(c);
                }
            }

            return maskedName.toString() + "@" + maskedDomain.toString();
        } else {
            StringBuilder sb = new StringBuilder();
            for (char c : s.toCharArray()) {
                if (Character.isDigit(c)) {
                    sb.append(c);
                }
            }

            String digits = sb.toString();
            int countryCodeLength = 0;
            if (digits.length() >= 10) {
                countryCodeLength = digits.length() - 10;
            }

            String localNumber = digits.substring(digits.length() - 10);
            String countryCode = "";
            if (countryCodeLength > 0) {
                countryCode = digits.substring(0, countryCodeLength);
            }

            String maskedNumber = "";
            if (countryCodeLength == 0) {
                maskedNumber = "-*-" + localNumber.substring(localNumber.length() - 10);
            } else if (countryCodeLength == 1) {
                maskedNumber = "+---" + localNumber.substring(localNumber.length() - 10);
            } else if (countryCodeLength == 2) {
                maskedNumber = "+--*" + localNumber.substring(localNumber.length() - 10);
            } else {
                maskedNumber = "+---" + localNumber.substring(localNumber.length() - 10);
            }

            return maskedNumber;
        }
    }
}

