        if (input == null || input.length == 0) {
            return new int[0][0];
        }

        int rows = input.length;
        int cols = input[0].length;

        int[][] transposedMatrix = new int[cols][rows];

        for (int i = 0; i < rows; i++) {
            for (int j = 0; j < cols; j++) {
