import java.util.HashSet;

public class Solution {
    public int[] fairCandySwap(int[] aliceSizes, int[] bobSizes) {
        long sumAlice = 0;
        long sumBob = 0;

        for (int size : aliceSizes) {
            sumAlice += size;
        }

        for (int size : bobSizes) {
            sumBob += size;
        }

        long diff = sumAlice - sumBob;

        HashSet<Integer> bobSet = new HashSet<>();
        for (int size : bobSizes) {
            bobSet.add(size);
        }

        for (int aliceSize : aliceSizes) {
            long target = aliceSize - diff / 2;
            if (bobSet.contains((int) target)) {
                return new int[]{aliceSize, (int) target};
            }
        }

        return new int[]{0, 0};
    }
}

