public class Solution {
    public double new21Game(int n, int k, int w) {
        double[] dp = new double[n + 1];
        dp[0] = 1.0;

        for (int i = 1; i <= n; i++) {
            dp[i] = 0.0;
            for (int j = 1; j <= w && j <= i; j++) {
                dp[i] += dp[i - j] * (double) 1 / w;
