public class Solution {
    public List<String> findAndReplacePattern(String[] words, String pattern) {
        List<String> result = new ArrayList<>();
        if (words == null || words.length == 0 || pattern == null || pattern.length() == 0) {
            return result;
        }

        for (String word : words) {
            if (word.length() != pattern.length()) {
                continue;
            }

            if (match(word, pattern)) {
                result.add(word);
            }
        }

        return result;
    }

    private boolean match(String word, String pattern) {
        HashMap<Character, Character> map = new HashMap<>();
        HashMap<Character, Character> reverseMap = new HashMap<>();

        for (int i = 0; i < word.length(); i++) {
            char wordChar = word.charAt(i);
            char patternChar = pattern.charAt(i);

            if (!map.containsKey(patternChar)) {
                if (reverseMap.containsKey(wordChar)) {
                    return false;
                }
                map.put(patternChar, wordChar);
                reverseMap.put(wordChar, patternChar);
            } else {
                if (map.get(patternChar) != wordChar) {
                    return false;
                }
            }
        }

        return true;
    }
}

