            if (num.contains(".")) {
                try {
                    Double.parseDouble(num);
                    current.add(num);
                    helper(s, i + 1, current, result);
                    current.remove(current.size() - 1);
                } catch (NumberFormatException e) {
                    continue;
                }
            } else {
                try {
                    Integer.parseInt(num);
                    current.add(num);
                    helper(s, i + 1, current, result);
                    current.remove(current.size() - 1);
