import java.util.Arrays;

public class Solution {
    public int[] hitBricks(int[][] grid, int[][] hits) {
        int m = grid.length;
        int n = grid[0].length;
        int[] result = new int[hits.length];

        // Mark hits as -1 to simulate removal
        for (int[] hit : hits) {
            int row = hit[0];
            int col = hit[1];
            if (grid[row][col] == 1) {
                grid[row][col] = -1;
            }
        }

        // Find stable bricks
        int stableCount = 0;
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 1) {
                    if (isStable(grid, i, j)) {
                        stableCount++;
                    }
                }
            }
        }

        // Apply hits and count falling bricks
        for (int i = 0; i < hits.length; i++) {
            int row = hits[i][0];
            int col = hits[i][1];

            if (grid[row][col] == 1) {
                grid[row][col] = -1;
                int fallingBricks = 0;

                // Check if the hit brick was stable
                if (isStable(grid, row, col)) {
                    fallingBricks = 1;
                }

                // Find and remove unstable bricks connected to the hit brick
                removeUnstable(grid, row, col);

                result[i] = fallingBricks;
            } else {
                result[i] = 0;
            }
        }

        return result;
    }

    private boolean isStable(int[][] grid, int row, int col) {
        int m = grid.length;
        int n = grid[0].length;

        if (row == 0) {
            return true;
        }

        if (grid[row][col] == 0) {
            return false;
        }

        int[][] directions = {{-1, 0}, {1, 0}, {0, -1}, {0, 1}};
        for (int[] dir : directions) {
            int newRow = row + dir[0];
            int newCol = col + dir[1];
            if (newRow >= 0 && newRow < m && newCol >= 0 && newCol < n && grid[newRow][newCol] == 1 && isStable(grid, newRow, newCol)) {
                return true;
            }
        }

        return false;
    }

    private void removeUnstable(int[][] grid, int row, int col) {
        int m = grid.length;
        int n = grid[0].length;

        if (row < 0 || row >= m || col < 0 || col >= n || grid[row][col] != 1) {
            return;
        }

        grid[row][col] = 0;

        int[][] directions = {{-1, 0}, {1, 0}, {0, -1}, {0, 1}};
        for (int[] dir : directions) {
            int newRow = row + dir[0];
            int newCol = col + dir[1];
            removeUnstable(grid, newRow, newCol);
        }
    }
}

