public class Solution {
    public int surfaceArea(int[][] grid) {
        int n = grid.length;
        int surfaceArea = 0;

        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] > 0) {
                    surfaceArea += 2; // Top and bottom faces
                    surfaceArea += getSurfaceArea(grid, i, j);
                }
            }
        }

        return surfaceArea;
    }

    private int getSurfaceArea(int[][] grid, int i, int j) {
        int n = grid.length;
        int surfaceArea = 0;

        // Check top face
        if (i == 0 || grid[i - 1][j] == 0) {
            surfaceArea += grid[i][j];
        }

        // Check bottom face
        if (i == n - 1 || grid[i + 1][j] == 0) {
            surfaceArea += grid[i][j];
        }

        // Check left face
        if (j == 0 || grid[i][j - 1] == 0) {
            surfaceArea += grid[i][j];
        }

        // Check right face
        if (j == n - 1 || grid[i][j + 1] == 0) {
            surfaceArea += grid[i][j];
        }

        return surfaceArea;
    }
}

