public class Solution {
    public TreeNode increasingBST(final TreeNode root) {
        if (root == null) {
            return null;
        }

        LinkedList<TreeNode> stack = new LinkedList<>();
        TreeNode prev = null;
        TreeNode head = null;

        TreeNode curr = root;
        while (curr != null || !stack.isEmpty()) {
            while (curr != null) {
                stack.push(curr);
                curr = curr.left;
            }

            curr = stack.pop();

            if (prev != null) {
                prev.left = null;
                prev.right = curr;
            } else {
                head = curr;
            }

            prev = curr;
            curr = curr.right;
        }

        return head;
    }
}

