public class Solution {
    public boolean reorderedPowerOf2(int n) {
        Map<Integer, Integer> digitCounts = countDigits(n);
        for (int i = 0; i < 31; i++) {
            int powerOfTwo = 1 << i;
            Map<Integer, Integer> powerOfTwoDigitCounts = countDigits(powerOfTwo);
            if (digitCounts.equals(powerOfTwoDigitCounts)) {
                return true;
            }
        }
        return false;
    }

    private Map<Integer, Integer> countDigits(int n) {
        Map<Integer, Integer> digitCounts = new HashMap<>();
        String s = String.valueOf(n);
        for (char c : s.toCharArray()) {
            int digit = c - '0';
            digitCounts.put(digit, digitCounts.getOrDefault(digit, 0) + 1);
        }
        return digitCounts;
    }
}

