public class Solution {
    public int expressiveWords(String s, String[] words) {
        int stretchyCount = 0;
        for (String word : words) {
            if (isStretchy(s, word)) {
                stretchyCount++;
            }
        }
        return stretchyCount;
    }

    private boolean isStretchy(String s, String word) {
        if (s.length() < word.length()) {
            return false;
        }

        int[] sGroups = getGroups(s);
        int[] wordGroups = getGroups(word);

        if (sGroups.length != wordGroups.length) {
            return false;
        }

        for (int i = 0; i < sGroups.length; i++) {
            if (sGroups[i] < wordGroups[i]) {
                return false;
            }
            if (wordGroups[i] > 0 && wordGroups[i] < 3 && sGroups[i] < 3) {
                return false;
            }
            if (wordGroups[i] > 0 && wordGroups[i] < 3 && sGroups[i] >= 3) {
                if (sGroups[i] < 3) return false;
            }
        }

        return true;
    }

    private int[] getGroups(String str) {
        if (str.isEmpty()) {
            return new int[0];
        }

        int[] groups = new int[0];
        int i = 0;
        while (i < str.length()) {
            int j = i;
            while (j < str.length() && str.charAt(i) == str.charAt(j)) {
                j++;
            }
            groups = resizeArray(groups, groups.length + 1);
            groups[groups.length - 1] = j - i;
            i = j;
        }
        return groups;
    }

    private int[] resizeArray(int[] arr, int newSize) {
        int[] newArr = new int[newSize];
        System.arraycopy(arr, 0, newArr, 0, Math.min(arr.length, newSize));
        return newArr;
    }
}

