import java.util.*;

public class Solution {
    public int kSimilarity(String a, String b) {
        if (a.equals(b)) {
            return 0;
        }

        Queue<String> q = new LinkedList<>();
        q.offer(a);
        Set<String> visited = new HashSet<>();
        visited.add(a);
        int k = 0;

        while (!q.isEmpty()) {
            int size = q.size();
            for (int i = 0; i < size; i++) {
                String curr = q.poll();
                if (curr.equals(b)) {
                    return k;
                }

                int j = 0;
                while (j < curr.length() && curr.charAt(j) == b.charAt(j)) {
                    j++;
                }

                for (int l = j + 1; l < curr.length(); l++) {
                    if (curr.charAt(l) == b.charAt(j) && curr.charAt(l) != b.charAt(l)) {
                        String next = swap(curr, j, l);
                        if (!visited.contains(next)) {
                            q.offer(next);
                            visited.add(next);
                        }
                    }
                }
            }
            k++;
        }

        return -1;
    }

    private String swap(String s, int i, int j) {
        char[] chars = s.toCharArray();
        char temp = chars[i];
        chars[i] = chars[j];
        chars[j] = temp;
        return new String(chars);
    }
}

