        int n = listA.length;
        int[][] dpA = new int[n][2];
        int[][] dpB = new int[n][2];

        dpA[0][0] = 0;
        dpA[0][1] = 1;
        dpB[0][0] = 1;
        dpB[0][1] = 0;

        for (int i = 1; i < n; i++) {
            dpA[i][0] = dpA[i - 1][0];
            dpA[i][1] = dpA[i - 1][1];

            dpB[i][0] = dpB[i - 1][0];
            dpB[i][1] = dpB[i - 1][1];

            if (listA[i] > listA[i - 1]) {
                dpA[i][0] = Math.min(dpA[i][0], dpA[i - 1][0]);
            }
            if (listA[i] > listB[i - 1]) {
                dpA[i][1] = Math.min(dpA[i][1], dpA[i - 1][0] + 1);
