            if (listB[i] > listA[i - 1]) {
                dpB[i][0] = Math.min(dpB[i][0], dpB[i - 1][0]);
            }
            if (listB[i] > listB[i - 1]) {
                dpB[i][1] = Math.min(dpB[i][1], dpB[i - 1][0] + 1);
            }
        }

