public class Solution {
    public int rectangleArea(int[][] rectangles) {
        int MOD = 1000000007;
        List<Integer> xValues = new ArrayList<>();
        for (int[] rect : rectangles) {
            xValues.add(rect[0]);
            xValues.add(rect[2]);
        }
        Collections.sort(xValues);

        long totalArea = 0;
        for (int i = 0; i < xValues.size() - 1; i++) {
            int x1 = xValues.get(i);
            int x2 = xValues.get(i + 1);
            List<int[]> activeRectangles = new ArrayList<>();
            for (int[] rect : rectangles) {
                if (rect[0] <= x1 && x2 <= rect[2]) {
                    activeRectangles.add(rect);
                }
            }

            Collections.sort(activeRectangles, (a, b) -> a[1] - b[1]);

            long yCovered = 0;
            int currentY = Integer.MIN_VALUE;
            for (int[] rect : activeRectangles) {
                int y1 = rect[1];
                int y2 = rect[3];
                if (y1 > currentY) {
                    yCovered = (yCovered + (long) (y2 - y1)) % MOD;
                    currentY = y2;
                } else if (y2 > currentY) {
                    yCovered = (yCovered + (long) (y2 - currentY)) % MOD;
                    currentY = y2;
                }
            }

            totalArea = (totalArea + (long) (x2 - x1) * yCovered) % MOD;
        }

        return (int) totalArea;
    }
