import com_github_leetcode.TreeNode;
import java.util.ArrayList;
import java.util.List;
public class Solution {
    public List<Integer> distanceK(TreeNode root, TreeNode target, int k) {
        List<Integer> result = new ArrayList<>();
        if (root == null || target == null) {
            return result;
        }

        parentMap(root, target);

        List<TreeNode> queue = new ArrayList<>();
        queue.add(target);
        int distance = 0;

        while (distance <= k && !queue.isEmpty()) {
            int size = queue.size();
            for (int i = 0; i < size; i++) {
                TreeNode node = queue.remove(0);
                if (distance == k) {
                    result.add(node.val);
                }

                if (node.left != null) {
                    queue.add(node.left);
                }
                if (node.right != null) {
                    queue.add(node.right);
                }
                if (node.parent != null) {
                    queue.add(node.parent);
                }
            }
            distance++;
        }

        return result;
    }

    private void parentMap(TreeNode root, TreeNode target) {
        if (root == null) {
            return;
        }

        root.parent = null;

        if (root.left != null) {
            root.left.parent = root;
            parentMap(root.left, target);
        }
        if (root.right != null) {
            root.right.parent = root;
            parentMap(root.right, target);
        }
    }
}

