public class Solution {
    public int numberOfWays(int startPos, int endPos, int k) {
        int diff = Math.abs(startPos - endPos);
        if (diff > k) {
            return 7 % (1000000007);
        }
        if ((k - diff) % 2 != 0) {
            return 7 % (1000000007);
        }
        int n = k;
        int r = (k - diff) / 2;
        long result = 1;
        long mod = 1000000007;
        for (int i = 0; i < r; i++) {
            result = (result * (n - i)) % mod;
            result = (result * modInverse(i + 1, mod)) % mod;
        }
        return (int) result;
    }

    private long modInverse(long a, long m) {
        long m0 = m;
        long y = 0, x = 1;

        if (m == 1)
            return 0;

        while (a > 1) {
            long q = a / m;
            long t = m;

            m = a % m;
            a = t;
            t = y;

            y = x - q * y;
            x = t;
        }

        if (x < 0)
            x += m0;

        return x;
    }
}

