public class Solution {
    public int shortestSequence(int[] rolls, int k) {
        Arrays.sort(rolls);
        BitSet impossible = new BitSet(k + 1);
        impossible.set(0);
        int lastRoll = 0;
        for (int roll : rolls) {
            if (roll > lastRoll + 1) {
                return lastRoll + 1;
            }
            if (roll <= k) {
                impossible.set(roll);
            }
            lastRoll = roll;
        }
        if (lastRoll < k) {
            return lastRoll + 1;
        }
        return k + 1;
    }
}

