import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

public class Solution {
    public int closestMeetingNode(int[] edges, int node1, int node2) {
        int n = edges.length;
        Map<Integer, List<Integer>> graph = new HashMap<>();
        for (int i = 0; i < n; i++) {
            graph.put(i, new ArrayList<>());
            if (edges[i] != -1) {
                graph.get(i).add(edges[i]);
            }
        }

        int bestNode = -1;
        int minMaxDist = Integer.MAX_VALUE;

        for (int i = 0; i < n; i++) {
            int dist1 = bfs(graph, node1, i);
            int dist2 = bfs(graph, node2, i);

            if (dist1 != -1 && dist2 != -1) {
                int maxDist = Math.max(dist1, dist2);
                if (maxDist < minMaxDist) {
                    minMaxDist = maxDist;
                    bestNode = i;
                } else if (maxDist == minMaxDist && i < bestNode) {
                    bestNode = i;
                }
            }
        }

        return bestNode;
    }

    private int bfs(Map<Integer, List<Integer>> graph, int startNode, int targetNode) {
        int n = graph.size();
        int[] dist = new int[n];
        for (int i = 0; i < n; i++) {
            dist[i] = -1;
        }
        dist[startNode] = 0;
        List<Integer> queue = new ArrayList<>();
        queue.add(startNode);

        int head = 0;
        while (head < queue.size()) {
            int u = queue.get(head++);
            if (u == targetNode) {
                return dist[u];
            }
            List<Integer> neighbors = graph.get(u);
            if (neighbors != null) {
                for (int v : neighbors) {
                    if (dist[v] == -1) {
                        dist[v] = dist[u] + 1;
                        queue.add(v);
                    }
                }
            }
        }
        return -1;
    }
}

