public class Solution {
    public int peopleAwareOfSecret(int n, int delay, int forget) {
        long MOD = 1000000007;
        long[] aware = new long[n + 1];
        aware[0] = 1;
        long count = 1;

        for (int i = 1; i <= n; i++) {
            if (i >= delay) {
                count = (count + aware[i - delay]) % MOD;
            }
            if (i >= forget) {
                aware[i] = (aware[i - 1] - aware[i - forget] + MOD) % MOD;
            } else {
                aware[i] = aware[i - 1];
            }
            aware[i] = (aware[i] + count) % MOD;
            count = 0;
        }

        return (int) aware[n];
    }
}

