     */
    public int minTrainingHours(int initialEnergy, int initialExperience, int[] energy, int[] experience) {
        int n = energy.length;
        int hours = 0;

        for (int i = 0; i < n; i++) {
            if (initialEnergy > energy[i] && initialExperience > experience[i]) {
                initialEnergy -= energy[i];
                initialExperience += experience[i];
            } else {
                int diffEnergy = energy[i] - initialEnergy;
                int diffExperience = experience[i] - initialExperience;

                if (diffEnergy > 0 && diffExperience > 0) {
                    hours += Math.max(diffEnergy, diffExperience);
                    initialEnergy += Math.max(0, diffEnergy);
                    initialExperience += Math.max(0, diffExperience);
                } else if (diffEnergy > 0) {
                    hours += diffEnergy;
                    initialEnergy += diffEnergy;
                } else if (diffExperience > 0) {
                    hours += diffExperience;
                    initialExperience += diffExperience;
                }

                if (initialEnergy > energy[i] && initialExperience > experience[i]) {
                    initialEnergy -= energy[i];
                    initialExperience += experience[i];
                } else {
                    return -1;
                }
            }
        }

        return hours;
    }
}

