import com_github_leetcode.ListNode;

public class Solution {
    /**
     * Given two integers m and n, which represent the dimensions of a matrix.
     * You are also given the head of a linked list of integers.
     * Generate an m x n matrix that contains the integers in the linked list presented in spiral order (clockwise), starting from the top-left of the matrix.
     * If there are remaining empty spaces, fill them with -1.
     *
     * @param m     The number of rows in the matrix.
     * @param n     The number of columns in the matrix.
     * @param head The head of the linked list.
     * @return The generated matrix.
     */
    public int[][] generateMatrix(int m, int n, ListNode head) {
        int[][] matrix = new int[m][n];
        int rowStart = 0, rowEnd = m - 1;
        int colStart = 0, colEnd = n - 1;
        int index = 0;

        while (rowStart <= rowEnd && colStart <= colEnd && index < 1000) {
            // Traverse right
            for (int i = colStart; i <= colEnd; i++) {
                if (index < 1000) {
                    matrix[rowStart][i] = head.val;
                    head = head.next;
                    index++;
                } else {
                    break;
                }
            }
            rowStart++;

            // Traverse down
            for (int i = rowStart; i <= rowEnd; i++) {
                if (index < 1000) {
                    matrix[i][colEnd] = head.val;
                    head = head.next;
                    index++;
                } else {
                    break;
                }
            }
            colEnd--;

            // Traverse left
            if (rowStart <= rowEnd) {
                for (int i = colEnd; i >= colStart; i--) {
                    if (index < 1000) {
                        matrix[rowEnd][i] = head.val;
                        head = head.next;
                        index++;
                    } else {
                        break;
                    }
                }
                rowEnd--;
            }

            // Traverse up
            if (colStart <= colEnd) {
                for (int i = rowEnd; i >= rowStart; i--) {
                    if (index < 1000) {
                        matrix[i][colStart] = head.val;
                        head = head.next;
                        index++;
                    } else {
                        break;
                    }
                }
                colStart++;
            }
        }

        return matrix;
    }
}

