import java.util.Arrays;

public class Solution {
    public int distributeCookies(int[] c, int k) {
        int n = c.length;
        int[] assignment = new int[n];
        int[] childCookies = new int[k];
        int minUnfairness = Integer.MAX_VALUE;

        backtrack(c, k, 0, assignment, childCookies, minUnfairness);

        return minUnfairness;
    }

    private void backtrack(int[] c, int k, int index, int[] assignment, int[] childCookies, int minUnfairness) {
        if (index == c.length) {
            int maxCookies = 0;
            for (int cookies : childCookies) {
                maxCookies = Math.max(maxCookies, cookies);
            }
            minUnfairness = Math.min(minUnfairness, maxCookies);
            return;
        }

        for (int i = 0; i < k; i++) {
            assignment[index] = i;
            childCookies[i] += c[index];
            backtrack(c, k, index + 1, assignment, childCookies, minUnfairness);
            childCookies[i] -= c[index];
        }
    }
}

