public class Solution {
    public int increasingPath(int[][] grid) {
        int m = grid.length;
        int n = grid[0].length;
        long[][] dp = new long[m][n];
        long MOD = 1000000007;

        long ans = 0;
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                ans = (ans + dfs(grid, i, j, m, n, dp, MOD)) % MOD;
            }
        }

        return (int) ans;
    }

    private long dfs(int[][] grid, int i, int j, int m, int n, long[][] dp, long MOD) {
        if (dp[i][j] != 0) {
            return dp[i][j];
        }

        long count = 1;
        int[][] directions = {{0, 1}, {0, -1}, {1, 0}, {-1, 0}};

        for (int[] dir : directions) {
            int newRow = i + dir[0];
            int newCol = j + dir[1];

            if (newRow >= 0 && newRow < m && newCol >= 0 && newCol < n && grid[newRow][newCol] > grid[i][j]) {
                count = (count + dfs(grid, newRow, newCol, m, n, dp, MOD)) % MOD;
            }
        }

        dp[i][j] = count;
        return count;
    }
}

