import java.util.PriorityQueue;

public class Solution {
    public long kSum(int[] nums, int k) {
        PriorityQueue<Long> minHeap = new PriorityQueue<>();
        long sum = 0;
        for (int num : nums) {
            sum += num;
        }

        minHeap.offer(0L);

        for (int num : nums) {
            PriorityQueue<Long> newHeap = new PriorityQueue<>();
            for (long s : minHeap) {
                long newSum = s + num;
                newHeap.offer(newSum);
                if (newHeap.size() > k) {
                    newHeap.poll();
                }
            }
            for (long s : newHeap) {
                minHeap.offer(s);
                if (minHeap.size() > k) {
                    minHeap.poll();
                }
            }
        }

        return minHeap.peek();
    }
}

