import java.util.ArrayList;
import java.util.List;

public class Solution {
    private int n;
    private List<List<Integer>> adj;
    private int[] nums;
    private int minScore;

    public Solution(int n, int[] nums, int[][] edges) {
        this.n = n;
        this.nums = nums;
        this.adj = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            adj.add(new ArrayList<>());
        }
        for (int[] edge : edges) {
            int u = edge[0];
            int v = edge[1];
            adj.get(u).add(v);
            adj.get(v).add(u);
        }
        this.minScore = Integer.MAX_VALUE;
    }

    public int solve() {
        for (int i = 0; i < n; i++) {
            for (int j = i + 1; j < n; j++) {
                List<Integer> removedEdges = new ArrayList<>();
                removedEdges.add(i);
                removedEdges.add(j);

                List<Integer> componentXors = new ArrayList<>();
                List<List<Integer>> components = getComponents(removedEdges);

                for (List<Integer> component : components) {
                    int xor = 0;
                    for (int node : component) {
                        xor ^= nums[node];
                    }
                    componentXors.add(xor);
                }

                int maxXor = Integer.MIN_VALUE;
                int minXor = Integer.MAX_VALUE;
                for (int xor : componentXors) {
                    maxXor = Math.max(maxXor, xor);
                    minXor = Math.min(minXor, xor);
                }

                minScore = Math.min(minScore, maxXor - minXor);
            }
        }

        return minScore;
    }

    private List<List<Integer>> getComponents(List<Integer> removedEdges) {
        boolean[] visited = new boolean[n];
        List<List<Integer>> components = new ArrayList<>();

        for (int i = 0; i < n; i++) {
            if (!visited[i]) {
                List<Integer> component = new ArrayList<>();
                dfs(i, visited, removedEdges, component);
                components.add(component);
            }
        }

        return components;
    }

    private void dfs(int node, boolean[] visited, List<Integer> removedEdges, List<Integer> component) {
        visited[node] = true;
        component.add(node);

        for (int neighbor : adj.get(node)) {
            if (!visited[neighbor] && !removedEdges.contains(node) ||
                    !removedEdges.contains(neighbor)) {
                dfs(neighbor, visited, removedEdges, component);
            }
        }
    }
}

