public class Solution {
    public int minOperations(int[] nums, int[] numsDivide) {
        if (numsDivide.length == 0) {
            return 0;
        }

        int minDivisor = Arrays.stream(numsDivide).min().orElse(0);

        int minDeletions = Integer.MAX_VALUE;

        for (int i = 0; i < (1 << nums.length); i++) {
            int[] subset = new int[0];
            int deletions = 0;

            for (int j = 0; j < nums.length; j++) {
                if ((i >> j) % 2 == 0) {
                    subset = Arrays.copyOf(subset, subset.length + 1);
                    subset[subset.length - 1] = nums[j];
                } else {
                    deletions++;
                }
            }

            if (subset.length > 0) {
                int smallest = Arrays.stream(subset).min().orElse(0);
                boolean dividesAll = true;
                for (int num : numsDivide) {
                    if (num % smallest != 0) {
                        dividesAll = false;
                        break;
                    }
                }

                if (dividesAll) {
                    minDeletions = Math.min(minDeletions, deletions);
                }
            }
        }

        if (minDeletions == Integer.MAX_VALUE) {
            return -1;
        }

        return minDeletions;
    }
}

