import java.util.Arrays;

public class Solution {
    public long minSumSquareDiff(int[] nums1, int[] nums2, int k1, int k2) {
        int n = nums1.length;
        long[] diff = new long[n];
        for (int i = 0; i < n; i++) {
            diff[i] = Math.abs((long)nums1[i] - nums2[i]);
        }

        long[] sortedDiff = Arrays.copyOf(diff, n);
        Arrays.sort(sortedDiff);

        long totalK = k1 + k2;
        long minSum = 0;

        for (int i = 0; i < n; i++) {
            if (totalK > 0) {
                long diffVal = sortedDiff[i];
                if (diffVal == 0) {
                    continue;
                }

                long reduceBy = Math.min(totalK, diffVal);
                minSum += (reduceBy * (reduceBy + 1)) / 2;
                totalK -= reduceBy;
            } else {
                break;
            }
        }

        return minSum;
    }
}

