public class Solution {
    public long sellingWood(int m, int n, int[][] prices) {
        long[][] dp = new long[m + 1][n + 1];

        for (int i = 1; i <= m; i++) {
            for (int j = 1; j <= n; j++) {
                dp[i][j] = (long) i * j;
                for (int[] price : prices) {
                    int h = price[0];
                    int w = price[1];
                    int p = price[2];

                    if (h <= i && w <= j) {
                        dp[i][j] = Math.max(dp[i][j], (long) p + dp[i - h][j] + dp[h][j - w] - dp[i-h][j-w]);
                    }
                }
            }
        }

        return dp[m][n];
    }
}

