public class Solution {
    public int[][] buildMatrix(int k, int[][] rowC, int[][] colC) {
        if (k <= 0) {
            return new int[0][0];
        }

        int[][] matrix = new int[k][k];
        Map<Integer, Integer> rowPos = new HashMap<>();
        Map<Integer, Integer> colPos = new HashMap<>();
        List<Integer> rowOrder = new ArrayList<>();
        List<Integer> colOrder = new ArrayList<>();

        // Determine row order
        for (int[] condition : rowC) {
            int num = condition[0];
            if (!rowPos.containsKey(num)) {
                rowPos.put(num, -1);
            }
            if (!rowPos.containsKey(condition[1])) {
                rowPos.put(condition[1], -1);
            }
        }

        // Determine column order
        for (int[] condition : colC) {
            int num = condition[0];
            if (!colPos.containsKey(num)) {
                colPos.put(num, -1);
            }
            if (!colPos.containsKey(condition[1])) {
                colPos.put(condition[1], -1);
            }
        }

        // Build row order
        for (int i = 1; i <= k; i++) {
            if (rowPos.containsKey(i)) {
                rowOrder.add(i);
            }
        }

        // Build column order
        for (int i = 1; i <= k; i++) {
            if (colPos.containsKey(i)) {
                colOrder.add(i);
            }
        }

        int rowIdx = 0;
        int colIdx = 0;
        for (int i = 0; i < k; i++) {
            for (int j = 0; j < k; j++) {
                if (rowIdx < k && colIdx < k) {
                    matrix[i][j] = (rowIdx < k && colIdx < k) ? (rowIdx * k + colIdx + 1) : 0;
                    rowIdx++;
                    colIdx++;
                } else {
                    matrix[i][j] = 0;
                }
            }
        }

        return matrix;
    }
}

