import java.util.Stack;

public class Solution {
    public String smallestNumber(String pattern) {
        int n = pattern.length();
        Stack<Integer> stack = new Stack<>();
        int[] nums = new int[n + 1];
        int num = 1;
        for (int i = 0; i < n; i++) {
            if (pattern.charAt(i) == 'I') {
                stack.push(num);
                num++;
            } else {
                if (!stack.isEmpty()) {
                    nums[i] = stack.pop();
                } else {
                    nums[i] = num;
                    num++;
                }
                if (!stack.isEmpty()) {
                    nums[i] = Math.min(nums[i], stack.peek());
                }
                if (num <= 9) {
                    num++;
                }
            }
        }
        while (!stack.isEmpty()) {
            nums[n] = stack.pop();
        }
        StringBuilder sb = new StringBuilder();
        for (int i = 0; i <= n; i++) {
            sb.append(nums[i]);
        }
        return sb.toString();
    }
}

