public class Solution {
    public int[] smallestTrimmedNumbers(String[] nums, int[][] queries) {
        int[] answer = new int[queries.length];
        for (int i = 0; i < queries.length; i++) {
            int k = queries[i][0];
            int trim = queries[i][1];
            List<String> trimmedNums = new ArrayList<>();
            for (String num : nums) {
                if (num.length() >= trim) {
                    trimmedNums.add(num.substring(num.length() - trim));
                } else {
                    trimmedNums.add("");
                }
            }

            List<Integer> indices = new ArrayList<>();
            for (int j = 0; j < trimmedNums.size(); j++) {
                if (!trimmedNums.get(j).isEmpty()) {
                    indices.add(j);
                }
            }

            List<String> validTrimmedNums = new ArrayList<>();
            for (int index : indices) {
                validTrimmedNums.add(trimmedNums.get(index));
            }

            Integer[] sortedIndices = new Integer[validTrimmedNums.size()];
            for (int j = 0; j < validTrimmedNums.size(); j++) {
                sortedIndices[j] = j;
            }

            Arrays.sort(sortedIndices, (a, b) -> {
                int comparison = validTrimmedNums.get(a).compareTo(validTrimmedNums.get(b));
                if (comparison != 0) {
                    return comparison;
                } else {
                    return a - b;
                }
            });

            answer[i] = indices.get(sortedIndices[k - 1]);
        }
