public class Solution {
    public int longestSubsequence(String s, int k) {
        int n = s.length();
        int[][] dp = new int[n + 1][k + 1];

        for (int i = 0; i <= n; i++) {
            for (int j = 0; j <= k; j++) {
                dp[i][j] = -1;
            }
        }

        dp[0][0] = 0;

        for (int i = 1; i <= n; i++) {
            for (int j = 0; j <= k; j++) {
                dp[i][j] = dp[i - 1][j];
                if (s.charAt(i - 1) == '0') {
                    if (dp[i - 1][j] != -1) {
                        dp[i][j] = Math.max(dp[i][j], dp[i - 1][j] + 1);
                    }
                } else {
                    if (j < (1 << (i - 1))) {
                        if (dp[i - 1][j] != -1) {
                            dp[i][j] = Math.max(dp[i][j], dp[i - 1][j] + 1);
                        }
                    } else {
                        if (dp[i - 1][j] != -1) {
                            dp[i][j] = Math.max(dp[i][j], dp[i - 1][j]);
                        }
                    }
                }
            }
        }

        int ans = 0;
        for (int j = 0; j <= k; j++) {
            ans = Math.max(ans, dp[n][j]);
        }
        return ans;
    }
}

