public class Solution {
    public int latestTimeCatchTheBus(int[] buses, int[] passengers, int capacity) {
        Arrays.sort(buses);
        Arrays.sort(passengers);

        int latestArrival = -1;
        int busIndex = buses.length - 1;
        int passengerIndex = passengers.length - 1;

        while (busIndex >= 0) {
            int busDepartureTime = buses[busIndex];
            int boardedPassengers = 0;
            int passengerArrivalTime = -1;

            while (passengerIndex >= 0 && passengers[passengerIndex] <= busDepartureTime && boardedPassengers < capacity) {
                boardedPassengers++;
                passengerArrivalTime = passengers[passengerIndex];
                passengerIndex--;
            }

            if (boardedPassengers > 0) {
                latestArrival = Math.max(latestArrival, passengerArrivalTime);
            }

            busIndex--;
        }

        return latestArrival;
    }
}

