        for (int i = 0; i < logs.length; i++) {
            int currentId = logs[i][0];
            int currentTime = logs[i][1];

            if (i == 0) {
                maxTime = currentTime;
                hardestWorkerId = currentId;
            } else {
                int previousTime = logs[i - 1][1];
                int timeSpent = currentTime - previousTime;

                if (timeSpent > maxTime) {
                    maxTime = timeSpent;
                    hardestWorkerId = currentId;
                } else if (timeSpent == maxTime) {
                    hardestWorkerId = Math.min(hardestWorkerId, currentId);
                }
            }
        }

        return hardestWorkerId;
    }
}

