import com_github_leetcode.TreeNode;
import java.util.HashMap;
import java.util.Map;

public class Solution {
    private TreeNode root;
    private int[] answer;
    private Map<Integer, TreeNode> nodeMap;

    public int[] treeQueries(TreeNode root, int[] queries) {
        this.root = root;
        this.answer = new int[queries.length];
        this.nodeMap = new HashMap<>();
        buildNodeMap(root, 0);

        for (int i = 0; i < queries.length; i++) {
            removeSubtree(root, queries[i]);
            answer[i] = height(root);
            resetTree(root);
        }

        return answer;
    }

    private void buildNodeMap(TreeNode node, int val) {
        if (node == null) {
            return;
        }
        nodeMap.put(node.val, node);
        buildNodeMap(node.left, 2 * val + 1);
        buildNodeMap(node.right, 2 * val + 2);
    }

    private void removeSubtree(TreeNode root, int val) {
        if (root == null || root.val == val) {
            return;
        }

        if (root.left != null && root.left.val == val) {
            root.left = null;
            return;
        }

        if (root.right != null && root.right.val == val) {
            root.right = null;
            return;
        }

        removeSubtree(root.left, val);
        removeSubtree(root.right, val);
    }

    private int height(TreeNode root) {
        if (root == null) {
            return -1;
        }
        return 1 + Math.max(height(root.left), height(root.right));
    }

    private void resetTree(TreeNode root) {
        if (root == null) {
            return;
        }
        if (root.left != null) {
            resetTree(root.left);
        }
        if (root.right != null) {
            resetTree(root.right);
        }
    }
}

