public class Solution {
    public long minimumTotalDistance(List<Integer> robot, int[][] f) {
        int n = robot.size();
        int m = f.length;

        // Sort robots by position
        Integer[] robotArray = robot.toArray(new Integer[0]);
        Arrays.sort(robotArray);

        // Sort factories by position, then by capacity (0-capacity to the end)
        Arrays.sort(f, (a, b) -> {
            if (a[0] != b[0]) {
                return a[0] - b[0];
            } else {
                return b[1] - a[1]; // Sort by descending capacity if positions are the same
            }
        });

        long totalDistance = 0;
        int[] factoryCapacity = new int[m];
        Arrays.fill(factoryCapacity, 0);

        for (int i = 0; i < n; i++) {
            int robotPos = robotArray[i];
            int bestFactoryIndex = -1;
            long minCost = Long.MAX_VALUE;

            for (int j = 0; j < m; j++) {
                if (factoryCapacity[j] < f[j][1]) {
                    long cost = Math.abs(robotPos - f[j][0]);
                    if (cost < minCost) {
                        minCost = cost;
                        bestFactoryIndex = j;
                    }
                }
            }

            if (bestFactoryIndex != -1) {
                totalDistance += minCost;
                factoryCapacity[bestFactoryIndex]++;
            }
        }

        return totalDistance;
    }
}

