public class Solution {
    public int deleteString(String s) {
        int n = s.length();
        int[] dp = new int[n + 1];

        for (int i = 1; i <= n; i++) {
            dp[i] = dp[i - 1] + 1;
            for (int j = 1; j < i; j++) {
                String prefix = s.substring(0, j);
                String suffix = s.substring(j, j + prefix.length());
                if (prefix.equals(suffix)) {
