public class Solution {
    public int[][] solve(TreeNode root, int[] queries) {
        TreeSet<Integer> treeValues = new TreeSet<>();
        inorderTraversal(root, treeValues);

        int[][] answer = new int[queries.length][2];
        for (int i = 0; i < queries.length; i++) {
            int query = queries[i];
            int minVal = -1;
            int maxVal = -1;

            // Find minVal
            Integer lower = treeValues.floor(query);
            if (lower != null) {
                minVal = lower;
            }

            // Find maxVal
            Integer higher = treeValues.ceiling(query);
            if (higher != null) {
                maxVal = higher;
            }

            answer[i][0] = minVal;
            answer[i][1] = maxVal;
        }

        return answer;
    }

    private void inorderTraversal(TreeNode root, TreeSet<Integer> treeValues) {
        if (root == null) {
            return;
        }

        inorderTraversal(root.left, treeValues);
        treeValues.add(root.val);
        inorderTraversal(root.right, treeValues);
    }
}

