import java.util.PriorityQueue;

public class Solution {
    public long totalCost(int[] costs, int k, int candidates) {
        long totalCost = 0;
        int n = costs.length;
        boolean[] hired = new boolean[n];

        for (int i = 0; i < k; i++) {
            int leftCandidateCount = Math.min(candidates, n - (k - i - 1));
            int rightCandidateCount = Math.min(candidates, k - i);

            PriorityQueue<Integer> leftHeap = new PriorityQueue<>((a, b) -> {
                if (costs[a] != costs[b]) {
                    return costs[a] - costs[b];
                } else {
                    return a - b;
                }
            });

            PriorityQueue<Integer> rightHeap = new PriorityQueue<>((a, b) -> {
                if (costs[a] != costs[b]) {
                    return costs[a] - costs[b];
                } else {
                    return a - b;
                }
            });

            for (int j = 0; j < leftCandidateCount; j++) {
                leftHeap.offer(j);
            }

            for (int j = n - rightCandidateCount; j < n; j++) {
                rightHeap.offer(j);
            }

            int bestWorker = -1;
            long minCost = Long.MAX_VALUE;

            while (!leftHeap.isEmpty() && !rightHeap.isEmpty()) {
                int leftWorker = leftHeap.peek();
                int rightWorker = rightHeap.peek();

                if (costs[leftWorker] < costs[rightWorker]) {
                    if (costs[leftWorker] < minCost) {
                        minCost = costs[leftWorker];
                        bestWorker = leftWorker;
                    }
                    leftHeap.poll();
                } else if (costs[rightWorker] < costs[leftWorker]) {
                    if (costs[rightWorker] < minCost) {
                        minCost = costs[rightWorker];
                        bestWorker = rightWorker;
                    }
                    rightHeap.poll();
                } else {
                    if (leftWorker < rightWorker) {
                        if (costs[leftWorker] < minCost) {
                            minCost = costs[leftWorker];
                            bestWorker = leftWorker;
                        }
                        leftHeap.poll();
                    } else {
                        if (costs[rightWorker] < minCost) {
                            minCost = costs[rightWorker];
                            bestWorker = rightWorker;
                        }
                        rightHeap.poll();
                    }
                }
            }

            while (!leftHeap.isEmpty()) {
                if (costs[leftHeap.peek()] < minCost) {
                    minCost = costs[leftHeap.peek()];
                    bestWorker = leftHeap.poll();
                } else {
                    leftHeap.poll();
                }
            }

            while (!rightHeap.isEmpty()) {
                if (costs[rightHeap.peek()] < minCost) {
                    minCost = costs[rightHeap.peek()];
                    bestWorker = rightHeap.poll();
                } else {
                    rightHeap.poll();
                }
            }

            totalCost += costs[bestWorker];
            hired[bestWorker] = true;
        }

        return totalCost;
    }
}

