        int bestSeed = -1;

        for (int seed : counts.keySet()) {
            int destroyed = 0;
            HashSet<Integer> destroyedTargets = new HashSet<>();
            for (int num : nums) {
                if ((num - seed) % space == 0) {
                    destroyedTargets.add(num);
                    destroyed++;
                }
            }

            if (destroyed > maxDestroyed) {
                maxDestroyed = destroyed;
                bestSeed = seed;
            } else if (destroyed == maxDestroyed && seed < bestSeed) {
                bestSeed = seed;
            }
        }

        return bestSeed;
    }
}

