import java.util.PriorityQueue;
import java.util.ArrayList;
import java.util.List;

public class Solution {
    public int maxStarSum(int[] nodeValues, int[][] edges, int maxNumberOfEdges) {
        int n = nodeValues.length;
        int maxStarSum = 0;

        for (int i = 0; i < n; i++) {
            List<Integer> neighbors = new ArrayList<>();
            for (int[] edge : edges) {
                if (edge[0] == i) {
                    neighbors.add(edge[1]);
                } else if (edge[1] == i) {
                    neighbors.add(edge[0]);
                }
            }

            PriorityQueue<Integer> pq = new PriorityQueue<>((a, b) -> nodeValues[b] - nodeValues[a]);
            pq.addAll(neighbors);

            int numEdges = 0;
            int currentStarSum = nodeValues[i];
            while (!pq.isEmpty() && numEdges < maxNumberOfEdges) {
                int neighbor = pq.poll();
                currentStarSum += nodeValues[neighbor];
                numEdges++;
            }
            maxStarSum = Math.max(maxStarSum, currentStarSum);
        }

        return maxStarSum;
    }
}

