public class Solution {
    public int minimumOperations(TreeNode root) {
        if (root == null) {
            return 0;
        }

        List<List<Integer>> levels = new ArrayList<>();
        getLevels(root, 0, levels);

        int operations = 0;
        for (List<Integer> level : levels) {
            int n = level.size();
            int swaps = 0;
            List<Integer> sortedLevel = new ArrayList<>(level);
            sortedLevel.sort(null);

            if (!level.equals(sortedLevel)) {
                int[] p = new int[n];
                for (int i = 0; i < n; i++) {
                    p[i] = i;
                }

                for (int i = 0; i < n; i++) {
                    if (level.get(i) != sortedLevel.get(i)) {
                        int j = -1;
                        for (int k = i + 1; k < n; k++) {
                            if (level.get(k) == sortedLevel.get(i)) {
                                j = k;
                                break;
                            }
                        }
                        if (j != -1) {
                            int temp = level.get(i);
                            level.set(i, level.get(j));
                            level.set(j, temp);
                            swaps++;
                        }
                    }
                }
            }
            operations += swaps;
        }

        return operations;
    }

    private void getLevels(TreeNode node, int level, List<List<Integer>> levels) {
        if (node == null) {
            return;
        }

        while (levels.size() <= level) {
            levels.add(new ArrayList<>());
        }

        levels.get(level).add(node.val);

        getLevels(node.left, level + 1, levels);
        getLevels(node.right, level + 1, levels);
    }
}

