import java.util.Arrays;

public class Solution {
    public int numberOfPaths(int[][] grid, int k) {
        int m = grid.length;
        int n = grid[0].length;
        int MOD = 1000000007;

        // dp[i][j][rem] stores the number of paths from (0, 0) to (i, j) with sum % k = rem
        int[][][] dp = new int[m][n][k];

        // Initialize the starting cell
        dp[0][0][grid[0][0] % k] = 1;

        // Iterate through the grid
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                for (int rem = 0; rem < k; rem++) {
                    // If there are paths to the current cell with remainder rem
                    if (dp[i][j][rem] > 0) {
                        // Move down
                        if (i + 1 < m) {
                            dp[i + 1][j][(rem + grid[i + 1][j]) % k] = (dp[i + 1][j][(rem + grid[i + 1][j]) % k] + dp[i][j][rem]) % MOD;
                        }
                        // Move right
                        if (j + 1 < n) {
                            dp[i][j + 1][(rem + grid[i][j + 1]) % k] = (dp[i][j + 1][(rem + grid[i][j + 1]) % k] + dp[i][j][rem]) % MOD;
                        }
                    }
                }
            }
        }

        return dp[m - 1][n - 1][0];
    }
}

