import java.util.Arrays;

public class Solution {
    public int maxJump(int[] stones) {
        if (stones == null || stones.length <= 1) {
            return 0;
        }

        int n = stones.length;
        int maxCost = 0;

        for (int i = 0; i < n; i++) {
            for (int j = i + 1; j < n; j++) {
                int jumpLength = Math.abs(stones[i] - stones[j]);
                maxCost = Math.max(maxCost, jumpLength);
            }
        }

        return maxCost;
    }
}

