public class Solution {
    public int longestContinuousSubstring(String s) {
        if (s == null || s.length() == 0) {
            return 0;
        }

        int maxLength = 0;
        int currentLength = 0;

        for (int i = 0; i < s.length(); i++) {
            if (i == 0) {
                currentLength = 1;
            } else {
                if (s.charAt(i) == s.charAt(i - 1) + 1) {
                    currentLength++;
                } else {
                    maxLength = Math.max(maxLength, currentLength);
                    currentLength = 1;
                }
            }
        }

        maxLength = Math.max(maxLength, currentLength);

        return maxLength;
    }
}

