public class Solution {
    private int n;
    private List<List<Integer>> adj;
    private int[] parent;

    public int mostProfitablePath(int[][] edges, int bob, int[] amount) {
        n = amount.length;
        adj = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            adj.add(new ArrayList<>());
        }
        parent = new int[n];
        Arrays.fill(parent, -1);

        for (int[] edge : edges) {
            int u = edge[0];
            int v = edge[1];
            adj.get(u).add(v);
            adj.get(v).add(u);
        }

        int[] leafDist = new int[n];
        Arrays.fill(leafDist, -1);
        dfs(0, 0, leafDist);

        int maxProfit = Integer.MIN_VALUE;
        for (int i = 0; i < n; i++) {
            if (leafDist[i] != -1) {
                maxProfit = Math.max(maxProfit, calculateProfit(bob, i));
            }
        }

        return maxProfit;
    }

    private void dfs(int node, int dist, int[] leafDist) {
        leafDist[node] = dist;
        for (int neighbor : adj.get(node)) {
            if (neighbor != parent[node]) {
                parent[neighbor] = node;
                dfs(neighbor, dist + 1, leafDist);
                parent[neighbor] = -1;
            }
        }
    }

    private int calculateProfit(int bobStart, int leaf) {
        int aliceProfit = 0;
        int bobProfit = 0;

        // Alice's path
        List<Integer> alicePath = new ArrayList<>();
        int current = leaf;
        while (current != 0) {
            alicePath.add(current);
            current = parent[current];
        }
        alicePath.add(0);

        // Bob's path
        List<Integer> bobPath = new ArrayList<>();
        current = bob;
        while (current != 0) {
            bobPath.add(current);
            current = parent[current];
        }
        bobPath.add(0);

        int i = 0;
        int j = 0;
        while (i < alicePath.size() && j < bobPath.size()) {
            int aliceNode = alicePath.get(i);
            int bobNode = bobPath.get(j);

            if (aliceNode == bobNode) {
                if (amount[aliceNode] > 0) {
                    aliceProfit += amount[aliceNode] / 2;
                    bobProfit += amount[aliceNode] / 2;
                } else {
                    aliceProfit -= Math.abs(amount[aliceNode]) / 2;
                    bobProfit -= Math.abs(amount[aliceNode]) / 2;
                }
                i++;
                j++;
            } else if (aliceNode < bobNode) {
                if (amount[aliceNode] > 0) {
                    aliceProfit += amount[aliceNode];
                } else {
                    aliceProfit -= Math.abs(amount[aliceNode]);
                }
                i++;
            } else {
                if (amount[bobNode] > 0) {
                    bobProfit += amount[bobNode];
                } else {
                    bobProfit -= Math.abs(amount[bobNode]);
                }
                j++;
            }
        }

        while (i < alicePath.size()) {
            int aliceNode = alicePath.get(i);
            if (amount[aliceNode] > 0) {
                aliceProfit += amount[aliceNode];
            } else {
                aliceProfit -= Math.abs(amount[aliceNode]);
            }
            i++;
        }

        while (j < bobPath.size()) {
            int bobNode = bobPath.get(j);
            if (amount[bobNode] > 0) {
                bobProfit += amount[bobNode];
            } else {
                bobProfit -= Math.abs(amount[bobNode]);
            }
            j++;
        }

        return aliceProfit;
    }
}

