public class Solution {
    private static final int MOD = 1000000007;

    public int beautifulPartitions(String s, int k, int l) {
        int n = s.length();
        if (k * l > n) {
            return 0;
        }

        int[] dp = new int[n + 1];
        dp[0] = 1;

        for (int i = l; i <= n; i++) {
            for (int j = 1; j <= k; j++) {
                if (i - j * l >= 0) {
                    int start = i - j * l;
                    if (isBeautiful(s, start, i)) {
                        dp[i] = (dp[i] + dp[start]) % MOD;
                    }
                }
            }
        }

        return dp[n];
    }

    private boolean isBeautiful(String s, int start, int end) {
        if (start >= end) {
            return false;
        }

        char firstChar = s.charAt(start);
        char lastChar = s.charAt(end - 1);

        if (!isPrime(firstChar) || !isNonPrime(lastChar)) {
            return false;
        }

        return true;
    }

    private boolean isPrime(char c) {
        return c == '2' || c == '3' || c == '5' || c == '7';
    }

    private boolean isNonPrime(char c) {
        return !isPrime(c);
    }
}

