import java.util.Arrays;
public class Solution {
    public long dividePlayers(int[] skill) {
        int n = skill.length;
        if (n % 2 != 0) {
            return -1;
        }

        Arrays.sort(skill);
        long totalSkill = 0;
        for (int s : skill) {
            totalSkill += s;
        }

        if (totalSkill % 2 != 0) {
            return -1;
        }

        long targetSkill = totalSkill / 2;
        long chemistrySum = 0;
        boolean[] used = new boolean[n];

        for (int i = 0; i < n; i++) {
            if (!used[i]) {
                int partnerIndex = -1;
                for (int j = i + 1; j < n; j++) {
                    if (!used[j] && skill[i] + skill[j] == targetSkill) {
                        partnerIndex = j;
                        break;
                    }
                }

                if (partnerIndex == -1) {
                    return -1;
                }

                chemistrySum += (long) skill[i] * skill[partnerIndex];
                used[i] = true;
                used[partnerIndex] = true;
            }
        }

        return chemistrySum;
    }
}

