public class Solution {
    public int componentValue(int[] nums, int[][] edges) {
        int n = nums.length;
        List<List<Integer>> adj = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            adj.add(new ArrayList<>());
        }
        for (int[] edge : edges) {
            int u = edge[0];
            int v = edge[1];
            adj.get(u).add(v);
            adj.get(v).add(u);
        }

        int maxEdges = -1;
        for (int i = 0; i < (1 << (n - 1)); i++) {
            List<List<Integer>> components = new ArrayList<>();
            List<Integer> deletedEdges = new ArrayList<>();
            int deletedEdgeCount = 0;

            for (int j = 0; j < n - 1; j++) {
                if ((i >> j) % 2 == 0) {
                    deletedEdges.add(j);
                    deletedEdgeCount++;
                }
            }

            boolean[] visited = new boolean[n];
            for (int j = 0; j < n; j++) {
                if (!visited[j]) {
                    List<Integer> component = new ArrayList<>();
                    dfs(j, adj, visited, component, deletedEdges);
                    components.add(component);
                }
            }

            if (components.size() > 0) {
                long targetSum = -1;
                boolean possible = true;
                for (List<Integer> component : components) {
                    long componentSum = 0;
                    for (int node : component) {
                        componentSum += nums[node];
                    }
                    if (targetSum == -1) {
                        targetSum = componentSum;
                    } else if (componentSum != targetSum) {
                        possible = false;
                        break;
                    }
                }

                if (possible) {
                    maxEdges = Math.max(maxEdges, deletedEdgeCount);
                }
            }
        }

        return maxEdges;
    }

    private void dfs(int node, List<List<Integer>> adj, boolean[] visited, List<Integer> component, List<Integer> deletedEdges) {
        visited[node] = true;
        component.add(node);
        for (int neighbor : adj.get(node)) {
            int edgeIndex = -1;
            for (int k = 0; k < adj.get(node).size(); k++) {
                if (adj.get(node).get(k) == neighbor) {
                    edgeIndex = k;
                    break;
                }
            }
            boolean isDeleted = false;
            for (int deletedEdge : deletedEdges) {
                int u = -1;
                int v = -1;
                for (int k = 0; k < edges.length; k++) {
                    if (edges[k][0] == node && edges[k][1] == neighbor) {
                        u = node;
                        v = neighbor;
                        break;
                    }
                    if (edges[k][0] == neighbor && edges[k][1] == node) {
                        u = neighbor;
                        v = node;
                        break;
                    }
                }
                if (u != -1 && v != -1) {
                    if (deletedEdges.contains(k)) {
                        isDeleted = true;
                        break;
                    }
                }
            }
            if (!visited[neighbor] && !isDeleted) {
                dfs(neighbor, adj, visited, component, deletedEdges);
            }
        }
    }

    private int[][] edges;
}

