public class Solution {
    public long minCost(int[] nums, int[] cost) {
        int n = nums.length;
        List<int[]> pairs = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            pairs.add(new int[]{nums[i], cost[i]});
        }

        pairs.sort(Comparator.comparingInt(a -> a[0]));

        long totalCost = 0;
        int[] prefixCost = new int[n];
        prefixCost[0] = pairs.get(0)[1];
        for (int i = 1; i < n; i++) {
            prefixCost[i] = prefixCost[i - 1] + pairs.get(i)[1];
        }

        long currentTarget = 0;
        long currentCost = 0;
        for (int i = 0; i < n; i++) {
            if (prefixCost[i] >= currentTarget) {
                currentTarget += pairs.get(i)[1];
            } else {
                long needed = currentTarget - prefixCost[i];
                totalCost += needed * pairs.get(i)[1];
                currentTarget += pairs.get(i)[1];
            }
        }

        return totalCost;
    }
}

