public class Solution {
    public int magnificentSets(int n, int[][] edges) {
        if (n == 1) {
            return 1;
        }

        List<List<Integer>> adj = new ArrayList<>();
        for (int i = 0; i <= n; i++) {
            adj.add(new ArrayList<>());
        }

        for (int[] edge : edges) {
            adj.get(edge[0]).add(edge[1]);
            adj.get(edge[1]).add(edge[0]);
        }

        int[] group = new int[n + 1];
        Arrays.fill(group, 0);
        int m = 0;

        for (int i = 1; i <= n; i++) {
            if (group[i] == 0) {
                m++;
                Queue<Integer> q = new LinkedList<>();
                q.offer(i);
                group[i] = m;

                while (!q.isEmpty()) {
                    int u = q.poll();
                    for (int v : adj.get(u)) {
                        if (group[v] == 0) {
                            group[v] = m;
                            q.offer(v);
                        } else if (group[v] != m) {
                            return -1;
                        }
                    }
                }
            }
        }

        if (edges.length == 0) {
            return n;
        }

        for (int[] edge : edges) {
            if (Math.abs(group[edge[0]] - group[edge[1]]) != 1) {
                return -1;
            }
        }

        return m;
    }
