public class Solution {
    /**
     * You are given a 0-indexed string word, consisting of lowercase English letters.
     * You need to select one index and remove the letter at that index from word so that the frequency of every letter present in word is equal.
     * Return true if it is possible to remove one letter so that the frequency of all letters in word are equal, and false otherwise.
     * Note: The frequency of a letter x is the number of times it occurs in the string.
     * You must remove exactly one letter and cannot chose to do nothing..
     */
    public boolean equalFrequency(String word) {
        int n = word.length();
        Map<Character, Integer> freq = new HashMap<>();
        for (char c : word.toCharArray()) {
            freq.put(c, freq.getOrDefault(c, 0) + 1);
        }

        for (int i = 0; i < n; i++) {
            char removedChar = word.charAt(i);
            Map<Character, Integer> tempFreq = new HashMap<>(freq);
            tempFreq.put(removedChar, tempFreq.get(removedChar) - 1);
            if (tempFreq.get(removedChar) == 0) {
                tempFreq.remove(removedChar);
            }

            if (tempFreq.isEmpty()) {
                return true;
            }

            int firstFreq = -1;
            boolean equal = true;
            for (int count : tempFreq.values()) {
                if (firstFreq == -1) {
                    firstFreq = count;
                } else if (count != firstFreq) {
                    equal = false;
                    break;
                }
            }

            if (equal) {
                return true;
            }
        }

        return false;
    }
}

