public class Solution {
    public String[] splitMessage(String message, int limit) {
        int n = message.length();
        if (n == 0) {
            return new String[0];
        }

        int minParts = Integer.MAX_VALUE;
        String[] bestParts = new String[0];

        for (int numParts = 1; numParts <= n; numParts++) {
            int partLength = (int) Math.ceil((double) n / numParts);
            if (partLength > limit) {
                continue;
            }

            List<String> parts = new ArrayList<>();
            int startIndex = 0;
            for (int i = 0; i < numParts - 1; i++) {
                int endIndex = Math.min(startIndex + limit, n);
                String part = message.substring(startIndex, endIndex);
                parts.add(part + "<" + (i + 1) + "/" + numParts + ">");
                startIndex = endIndex;
            }

            int lastPartLength = n - startIndex;
            String lastPart = message.substring(startIndex);
            parts.add(lastPart);

            boolean valid = true;
            for (String part : parts) {
                if (part.length() > limit && parts.size() > 1) {
                    valid = false;
                    break;
                }
            }
            if (valid) {
                if (numParts < minParts) {
                    minParts = numParts;
                    String[] result = new String[minParts];
                    for (int i = 0; i < minParts; i++) {
                        result[i] = parts.get(i);
                    }
                    bestParts = result;
                }
            }
        }

        if (bestParts.length == 0) {
            return new String[0];
        }

        return bestParts;
    }
}

