import java.util.Arrays;
import java.util.HashMap;
import java.util.Map;

public class Solution {
    public boolean canDistribute(int[] nums, int[] quantity) {
        if (nums == null || quantity == null || nums.length != quantity.length) {
            return false;
        }

        int n = nums.length;
        Arrays.sort(nums);

        Map<Integer, Integer> counts = new HashMap<>();
        for (int num : nums) {
            counts.put(num, counts.getOrDefault(num, 0) + 1);
        }

        for (int i = 0; i < n; i++) {
            int required = quantity[i];
            if (required <= 0) continue;

            int num = -1;
            for (int key : counts.keySet()) {
                if (counts.get(key) >= required) {
                    num = key;
                    break;
                }
            }

            if (num == -1) {
                return false;
            }

            counts.put(num, counts.get(num) - required);
            if (counts.get(num) == 0) {
                counts.remove(num);
            }
        }

        return true;
    }
}

