import java.util.Arrays;

public class Solution {
    public int minIncompatibility(int[] nums, int k) {
        int n = nums.length;
        if (n % k != 0) {
            return -1;
        }

        int subsetSize = n / k;
        Arrays.sort(nums);

        long[][] dp = new long[1 << n][k + 1];
        for (int i = 0; i < (1 << n); i++) {
            Arrays.fill(dp[i], -1);
        }

        dp[0][0] = 0;

        for (int mask = 0; mask < (1 << n); mask++) {
            if (dp[mask][0] == -1) {
                continue;
            }

            for (int i = 0; i < k; i++) {
                if (dp[mask][i] == -1) {
                    continue;
                }

                for (int j = 0; j < n; j++) {
                    if ((mask & (1 << j)) == 0) {
                        int newMask = mask | (1 << j);
                        long incompatibility = 0;
                        int maxVal = nums[j];
                        int minVal = nums[j];

                        for (int l = 0; l < n; l++) {
                            if ((newMask & (1 << l)) != 0) {
                                maxVal = Math.max(maxVal, nums[l]);
                                minVal = Math.min(minVal, nums[l]);
                            }
                        }
                        incompatibility = maxVal - minVal;

                        if (dp[newMask][i + 1] == -1 || dp[newMask][i + 1] > dp[mask][i] + incompatibility) {
                            dp[newMask][i + 1] = dp[mask][i] + incompatibility;
                        }
                    }
                }
            }

        if (dp[(1 << n) - 1][k] == -1) {
            return -1;
        }

        return (int) dp[(1 << n) - 1][k];
    }
}

