public class Solution {
    public int[][] restoreMatrix(int[] rowSum, int[] colSum) {
        int rows = rowSum.length;
        int cols = colSum.length;
        int[][] matrix = new int[rows][cols];

        for (int i = 0; i < rows; i++) {
            for (int j = 0; j < cols; j++) {
                if (i == 0 && j == 0) {
                    matrix[i][j] = Math.min(rowSum[i], colSum[j]);
                } else if (i == 0) {
                    matrix[i][j] = colSum[j] - colSum[j - 1];
                } else if (j == 0) {
                    matrix[i][j] = rowSum[i] - rowSum[i - 1];
                } else {
                    matrix[i][j] = 0;
                }
            }
        }

        for (int i = 0; i < rows; i++) {
            for (int j = 0; j < cols; j++) {
                if (i == 0 && j == 0) {
                    continue;
                } else if (i == 0) {
                    matrix[i][j] = rowSum[i] - matrix[i][j-1];
                } else if (j == 0) {
                    matrix[i][j] = colSum[j] - matrix[i-1][j];
                } else {
                    matrix[i][j] = 0;
                }
            }
        }

        return matrix;
    }
}

