import com_github_leetcode.TreeNode;
import java.util.ArrayList;
import java.util.List;

public class Solution {
    public boolean isEvenOddTree(TreeNode root) {
        if (root == null) {
            return true;
        }

        List<TreeNode> levelNodes = new ArrayList<>();
        levelNodes.add(root);
        int level = 0;

        while (!levelNodes.isEmpty()) {
            int size = levelNodes.size();
            List<Integer> values = new ArrayList<>();

            for (int i = 0; i < size; i++) {
                TreeNode node = levelNodes.get(i);
                if (node != null) {
                    values.add(node.val);
                    if (node.left != null) {
                        levelNodes.add(node.left);
                    }
                    if (node.right != null) {
                        levelNodes.add(node.right);
                    }
                }
            }

            if (level % 2 == 0) { // Even level
                if (!isOddIncreasing(values)) {
                    return false;
                }
            } else { // Odd level
                if (!isEvenDecreasing(values)) {
                    return false;
                }
            }

            level++;
        }

        return true;
    }

    private boolean isOddIncreasing(List<Integer> values) {
        if (values.size() <= 1) {
            return true;
        }

        for (int i = 0; i < values.size() - 1; i++) {
            if (values.get(i) % 2 == 0 || values.get(i) >= values.get(i + 1)) {
                return false;
            }
        }
        return true;
    }

    private boolean isEvenDecreasing(List<Integer> values) {
        if (values.size() <= 1) {
            return true;
        }

        for (int i = 0; i < values.size() - 1; i++) {
            if (values.get(i) % 2 != 0 || values.get(i) <= values.get(i + 1)) {
                return false;
            }
        }
        return true;
    }
}

