public class Solution {
    public String kthSmallestPath(int[] destination, int k) {
        int row = destination[0];
        int col = destination[1];
        int n = row + col;
        int[][] dp = new int[row + 1][col + 1];
        dp[0][0] = 1;
        for (int i = 0; i <= row; i++) {
            for (int j = 0; j <= col; j++) {
                if (i > 0) {
                    dp[i][j] += dp[i - 1][j];
                }
                if (j > 0) {
                    dp[i][j] += dp[i][j - 1];
                }
            }
        }

        StringBuilder path = new StringBuilder();
        int i = row;
        int j = col;
        while (i > 0 || j > 0) {
            if (i > 0) {
                int downPaths = dp[i - 1][j];
                if (k <= downPaths) {
                    path.append('V');
                    i--;
                } else {
                    path.append('H');
                    k -= downPaths;
                    j--;
                }
            } else {
                path.append('H');
                j--;
            }
        }

        return path.toString();
    }
}

