import java.util.Arrays;
import java.util.HashMap;
import java.util.Map;

public class Solution {
    public int[][] matrixRankTransform(int[][] matrix) {
        int m = matrix.length;
        int n = matrix[0].length;

        int[][] answer = new int[m][n];
        int rank = 0;

        // Flatten the matrix into a 1D array
        int[][] flattenedMatrix = new int[m * n][2];
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                flattenedMatrix[i * n + j][0] = matrix[i][j];
                flattenedMatrix[i * n + j][1] = i * n + j;
            }
        }

        // Sort the flattened matrix based on the values
        Arrays.sort(flattenedMatrix, (a, b) -> {
            if (a[0] != b[0]) {
                return a[0] - b[0];
            } else {
                return a[1] - b[1];
            }
        });

        // Assign ranks to the elements
        Map<Integer, Integer> rankMap = new HashMap<>();
        int currentRank = 0;
        for (int i = 0; i < m * n; i++) {
            if (!rankMap.containsKey(flattenedMatrix[i][0])) {
                rankMap.put(flattenedMatrix[i][0], currentRank++);
            }
            answer[flattenedMatrix[i][1] / n][flattenedMatrix[i][1] % n] = rankMap.get(flattenedMatrix[i][0]) + 1;
        }

        return answer;
    }
}

