import java.util.ArrayList;
import java.util.List;

public class Solution {
    public List<Boolean> areConnected(int n, int threshold, int[][] queries) {
        List<Boolean> answer = new ArrayList<>();
        UnionFind uf = new UnionFind(n + 1);

        for (int i = 1; i <= n; i++) {
            for (int j = i + 1; j <= n; j++) {
                if (hasCommonDivisorGreaterThanThreshold(i, j, threshold)) {
                    uf.union(i, j);
                }
            }
        }

        for (int[] query : queries) {
            int a = query[0];
            int b = query[1];
            answer.add(uf.find(a) == uf.find(b));
        }

        return answer;
    }

    private boolean hasCommonDivisorGreaterThanThreshold(int a, int b, int threshold) {
        for (int i = 2; i <= Math.min(a, b); i++) {
            if (a % i == 0 && b % i == 0 && i > threshold) {
                return true;
            }
        }
        return false;
    }

    private class UnionFind {
        private int[] parent;

        public UnionFind(int n) {
            parent = new int[n];
            for (int i = 0; i < n; i++) {
                parent[i] = i;
            }
        }

        public int find(int i) {
            if (parent[i] == i) {
                return i;
            }
            return parent[i] = find(parent[i]);
        }

        public void union(int i, int j) {
            int rootI = find(i);
            int rootJ = find(j);
            if (rootI != rootJ) {
                parent[rootI] = rootJ;
            }
        }
    }
}

