                }
            }
            ans[d - 1] = count;
        }
        return ans;
    }

    private boolean isConnected(int start, int end, List<Integer> subtree, List<List<Integer>> adj) {
        if (start == end) return true;

        boolean[] visited = new boolean[subtree.size()];
        List<Integer> q = new ArrayList<>();
        q.add(0);
        visited[0] = true;

        int head = 0;
        while (head < q.size()) {
            int uIndex = q.get(head++);
            int u = subtree.get(uIndex);

            for (int v : adj.get(u)) {
                if (subtree.contains(v) && !visited[subtree.indexOf(v)]) {
                    if (v == end) return true;
                    visited[subtree.indexOf(v)] = true;
                    q.add(subtree.indexOf(v));
                }
            }
        }
        return false;
    }

    private int distance(int start, int end, List<Integer> subtree, List<List<Integer>> adj) {
        if (start == end) return 0;

        boolean[] visited = new boolean[subtree.size()];
        int[] dist = new int[subtree.size()];
        List<Integer> q = new ArrayList<>();
        q.add(subtree.indexOf(start));
        visited[subtree.indexOf(start)] = true;
        dist[subtree.indexOf(start)] = 0;

        int head = 0;
        while (head < q.size()) {
            int uIndex = q.get(head++);
            int u = subtree.get(uIndex);

            for (int v : adj.get(u)) {
                if (subtree.contains(v) && !visited[subtree.indexOf(v)]) {
                    visited[subtree.indexOf(v)] = true;
                    dist[subtree.indexOf(v)] = dist[uIndex] + 1;
                    q.add(subtree.indexOf(v));
                }
            }
        }

        return dist[subtree.indexOf(end)];
    }
}

