import java.util.HashSet;
import java.util.LinkedList;
import java.util.Queue;
import java.util.Set;

public class Solution {
    public String solve(String s, int a, int b) {
        Queue<String> q = new LinkedList<>();
        Set<String> visited = new HashSet<>();
        q.offer(s);
        visited.add(s);
        String smallest = s;

        while (!q.isEmpty()) {
            String curr = q.poll();
            if (curr.compareTo(smallest) < 0) {
                smallest = curr;
            }

            // Operation 1: Add a to odd indices
            StringBuilder next1 = new StringBuilder(curr);
            for (int i = 1; i < next1.length(); i += 2) {
                int digit = next1.charAt(i) - '0';
                int newDigit = (digit + a) % 10;
                next1.setCharAt(i, (char) ('0' + newDigit));
            }
            String next1Str = next1.toString();
            if (!visited.contains(next1Str)) {
                q.offer(next1Str);
                visited.add(next1Str);
            }

            // Operation 2: Rotate right by b positions
            String next2 = curr.substring(curr.length() - b) + curr.substring(0, curr.length() - b);
            if (!visited.contains(next2)) {
                q.offer(next2);
                visited.add(next2);
            }
        }

        return smallest;
    }
}

