public class Solution {
    public int[] decrypt(int[] code, int k) {
        int n = code.length;
        int[] decryptedCode = new int[n];

        if (k == 0) {
            for (int i = 0; i < n; i++) {
                decryptedCode[i] = 0;
            }
            return decryptedCode;
        }

        for (int i = 0; i < n; i++) {
            if (k > 0) {
                int sum = 0;
                for (int j = 0; j < k; j++) {
                    sum += code[(i + j + 1) % n];
                }
                decryptedCode[i] = sum;
            } else {
                int sum = 0;
                for (int j = 0; j < Math.abs(k); j++) {
                    sum += code[(i - j + n) % n];
                }
                decryptedCode[i] = sum;
            }
        }

        return decryptedCode;
    }
}

