import java.util.HashSet;
import java.util.Set;

public class Solution {
    public static class Pair {
        int pos;
        boolean canJumpBackward;

        public Pair(int pos, boolean canJumpBackward) {
            this.pos = pos;
            this.canJumpBackward = canJumpBackward;
        }
    }

    public int minJumps(int[] forbidden, int a, int b, int x) {
        Set<Integer> forbiddenSet = new HashSet<>();
        for (int pos : forbidden) {
            forbiddenSet.add(pos);
        }

        Queue<Pair> queue = new LinkedList<>();
        queue.offer(new Pair(0, true));
        Set<Pair> visited = new HashSet<>();
        visited.add(new Pair(0, true));

        int jumps = 0;
        int maxReachable = 2000 + a + b;

        while (!queue.isEmpty()) {
            int size = queue.size();
            for (int i = 0; i < size; i++) {
                Pair current = queue.poll();
                if (current.pos == x) {
                    return jumps;
                }

                // Jump forward
                int nextPosForward = current.pos + a;
                if (nextPosForward >= 0 && nextPosForward <= maxReachable &&
                        !forbiddenSet.contains(nextPosForward) &&
                        !visited.contains(new Pair(nextPosForward, true))) {
                    queue.offer(new Pair(nextPosForward, true));
                    visited.add(new Pair(nextPosForward, true));
                }

                // Jump backward
                if (current.canJumpBackward) {
                    int nextPosBackward = current.pos - b;
                    if (nextPosBackward >= 0 && nextPosBackward <= maxReachable &&
                            !forbiddenSet.contains(nextPosBackward) &&
                            !visited.contains(new Pair(nextPosBackward, false))) {
                        queue.offer(new Pair(nextPosBackward, false));
                        visited.add(new Pair(nextPosBackward, false));
                    }
                }
            }
            jumps++;
        }

        return -1;
    }
}

