import java.util.Arrays;

public class Solution {
    public int[] bestCoordinate(int[][] towers, int radius) {
        int maxX = 0;
        int maxY = 0;
        for (int[] tower : towers) {
            maxX = Math.max(maxX, tower[0]);
            maxY = Math.max(maxY, tower[1]);
        }

        int bestX = -1;
        int bestY = -1;
        int maxQuality = -1;

        for (int x = 0; x <= maxX; x++) {
            for (int y = 0; y <= maxY; y++) {
                int currentQuality = 0;
                for (int[] tower : towers) {
                    double distance = Math.sqrt(Math.pow(x - tower[0], 2) + Math.pow(y - tower[1], 2));
                    if (distance <= radius) {
                        currentQuality += Math.floor((double) tower[2] / (1 + distance));
                    }
                }

                if (currentQuality > maxQuality) {
                    maxQuality = currentQuality;
                    bestX = x;
                    bestY = y;
                } else if (currentQuality == maxQuality) {
                    if (x < bestX) {
                        bestX = x;
                        bestY = y;
                    } else if (x == bestX && y < bestY) {
                        bestY = y;
                    }
                }
            }
        }

        return new int[]{bestX, bestY};
    }
}

