        int n = nums.length;
        int ans = 0;
        for (int i = 0; i < n; i++) {
            int evenSum = 0;
            int oddSum = 0;
            for (int j = 0; j < n; j++) {
                if (j % 2 == 0 && j != i) {
                    evenSum += nums[j];
                } else if (j % 2 != 0 && j != i) {
                    oddSum += nums[j];
