public class Solution {
    public int numberOfSets(int n, int k) {
        if (k == 0) {
            return 1;
        }
        if (k > (n + 1) / 2) {
            return 0;
        }

        long[][] dp = new long[n + 1][k + 1];
        dp[0][0] = 1;

        for (int i = 1; i <= n; i++) {
            for (int j = 0; j <= k; j++) {
                dp[i][j] = dp[i - 1][j];
                for (int l = 1; l <= i; l++) {
                    if (j > 0) {
                        dp[i][j] = (dp[i][j] + dp[l - 1][j - 1]) % 1000000007;
                    }
                }
            }
        }

        return (int) dp[n][k];
    }
}

package referenz;


public class Solution {
    public int stoneGameVII(int[] stones) {
        int n = stones.length;
        int[][] dp = new int[n][n];
        int[] prefixSum = new int[n + 1];
        for (int i = 0; i < n; i++) {
            prefixSum[i + 1] = prefixSum[i] + stones[i];
        }

        for (int len = 2; len <= n; len++) {
            for (int i = 0; i <= n - len; i++) {
                int j = i + len - 1;
                int aliceScore = prefixSum[j + 1] - prefixSum[i] - stones[i];
                int bobScore = prefixSum[j + 1] - prefixSum[i] - stones[j];
                dp[i][j] = Math.max(aliceScore - dp[i + 1][j], bobScore - dp[i][j - 1]);
            }
        }

        return (prefixSum[n] - dp[0][n - 1]);
    }
}

