import java.util.ArrayList;
import java.util.Comparator;
import java.util.List;
import java.util.PriorityQueue;
import java.util.TreeSet;

public class Solution {

    public List<Integer> busiestServers(int[] arrival, int[] load) {
        int k = arrival.length;
        int n = arrival.length;
        int[] serverLoad = new int[k];
        List<Integer> busiest = new ArrayList<>();
        int maxLoad = 0;

        for (int i = 0; i < n; i++) {
            int serverId = arrival[i] % k;
            boolean assigned = false;

            // Try to assign to the preferred server
            if (serverLoad[serverId] + load[i] <= arrival[i]) {
                serverLoad[serverId] += load[i];
                assigned = true;
            } else {
                // Find the next available server
                int nextServer = serverId;
                while (true) {
                    nextServer = (nextServer + 1) % k;
                    if (serverLoad[nextServer] + load[i] <= arrival[i]) {
                        serverLoad[nextServer] += load[i];
                        assigned = true;
                        break;
                    }
                    if (nextServer == serverId) {
                        break; // All servers are busy
                    }
                }
            }

            if (!assigned) {
                // Request dropped
            }
        }

        for (int i = 0; i < k; i++) {
            if (serverLoad[i] > maxLoad) {
                maxLoad = serverLoad[i];
                busiest.clear();
                busiest.add(i);
            } else if (serverLoad[i] == maxLoad) {
                busiest.add(i);
            }
        }

        return busiest;
    }

    public static class Server {
        int id;
        int busyTime;

        public Server(int id, int busyTime) {
            this.id = id;
            this.busyTime = busyTime;
        }
