public class Solution {
    /**
     * Alice and Bob take turns playing a game, with Alice starting first. There are n stones in a pile.
     * On each player's turn, they can remove a stone from the pile and receive points based on the stone's value.
     * Alice and Bob may value the stones differently. You are given two integer arrays of length n, aliceValues and bobValues.
     * Each aliceValues[i] and bobValues[i] represents how Alice and Bob, respectively, value the <code>i<sup>th</sup></code> stone.
     * The winner is the person with the most points after all the stones are chosen. If both players have the same amount of points, the game results in a draw.
     * Both players will play optimally. Both players know the other's values. Determine the result of the game, and:
     * If Alice wins, return 1
     * If Bob wins, return -1
     * If the game results in a draw, return 0
     *
     * Example 1:
     * Input: aliceValues = [1,3], bobValues = [2,1]
     * Output: 1
     * Explanation: If Alice takes stone 1 (0-indexed) first, Alice will receive 3 points. Bob can only choose stone 0, and will only receive 2 points. Alice wins.
     *
     * @param aliceValues An array of integers representing the values of the stones for Alice.
     * @param bobValues An array of integers representing the values of the stones for Bob.
     * @return 1 if Alice wins, -1 if Bob wins, and 0 if the game results in a draw.
     */
    public int solve(int[] aliceValues, int[] bobValues) {
        int n = aliceValues.length;
        int[] combinedValues = new int[n];
        for (int i = 0; i < n; i++) {
            combinedValues[i] = aliceValues[i] - bobValues[i];
        }

        PriorityQueue<Integer> pq = new PriorityQueue<>((a, b) -> b - a);
        for (int value : combinedValues) {
            pq.offer(value);
        }

        int aliceScore = 0;
        int bobScore = 0;
        boolean aliceTurn = true;

        while (!pq.isEmpty()) {
            int stoneValue = pq.poll();
            if (aliceTurn) {
                aliceScore += stoneValue;
            } else {
                bobScore += stoneValue;
            }
            aliceTurn = !aliceTurn;
        }

        if (aliceScore > bobScore) {
            return 1;
        } else if (bobScore > aliceScore) {
            return -1;
        } else {
            return 0;
        }
    }
}

