public class Solution {
    /**
     * You are the manager of a basketball team. For the upcoming tournament, you want to choose the team with the highest overall score.
     * The score of the team is the sum of scores of all the players in the team. However, the basketball team is not allowed to have conflicts.
     * A conflict exists if a younger player has a strictly higher score than an older player. A conflict does not occur between players of the same age.
     * Given two lists, scores and ages, where each scores[i] and ages[i] represents the score and age of the <code>i<sup>th</sup></code> player, respectively,
     * return the highest overall score of all possible basketball teams.
     *
     * @param scores the scores of the players
     * @param ages   the ages of the players
     * @return the highest overall score of all possible basketball teams
     */
    public long highestBasketballTeamScore(int[] scores, int[] ages) {
        int n = scores.length;
        Player[] players = new Player[n];
        for (int i = 0; i < n; i++) {
            players[i] = new Player(scores[i], ages[i]);
        }

        Arrays.sort(players, (a, b) -> a.age - b.age);

        long maxScore = 0;
        for (int i = 0; i < (1 << n); i++) {
            long currentScore = 0;
            boolean conflict = false;
            Player[] team = new Player[0];
            int teamSize = 0;

            for (int j = 0; j < n; j++) {
                if ((i >> j) % 2 == 1) {
                    if (teamSize > 0) {
                        for (int k = 0; k < teamSize; k++) {
                            if (players[j].age < team[k].age && players[j].score > team[k].score) {
                                conflict = true;
                                break;
                            }
                        }
                    }
                    if (!conflict) {
                        Player[] newTeam = Arrays.copyOf(team, teamSize + 1);
                        newTeam[teamSize] = players[j];
                        team = newTeam;
                        teamSize++;
                        currentScore += players[j].score;
                    }
                }
            }

            if (!conflict) {
                maxScore = Math.max(maxScore, currentScore);
            }
        }

        return maxScore;
    }

    private static class Player {
        int score;
        int age;

        public Player(int score, int age) {
            this.score = score;
            this.age = age;
        }
    }
