import java.util.LinkedList;
import java.util.List;
import java.util.Objects;
import java.util.PriorityQueue;
import java.util.Queue;

public class Solution {
    public int cutOffTree(List<List<Integer>> forest) {
        int m = forest.size();
        int n = forest.get(0).size();

        PriorityQueue<int[]> trees = new PriorityQueue<>((a, b) -> a[2] - b[2]);
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (forest.get(i).get(j) > 1) {
                    trees.offer(new int[]{i, j, forest.get(i).get(j)});
                }
            }
        }

        int steps = 0;
        int row = 0;
        int col = 0;

        while (!trees.isEmpty()) {
            int[] tree = trees.poll();
            int treeRow = tree[0];
            int treeCol = tree[1];
            int treeHeight = tree[2];

            int dist = bfs(forest, row, col, treeRow, treeCol);
            if (dist == -1) {
                return -1;
            }
            steps += dist;
            row = treeRow;
            col = treeCol;
            forest.get(treeRow).set(treeCol, 1);
        }

        return steps;
    }

    private int bfs(List<List<Integer>> forest, int startRow, int startCol, int endRow, int endCol) {
        int m = forest.size();
        int n = forest.get(0).size();
        Queue<int[]> queue = new LinkedList<>();
        queue.offer(new int[]{startRow, startCol, 0});
        boolean[][] visited = new boolean[m][n];
        visited[startRow][startCol] = true;

        int[][] directions = {{0, 1}, {0, -1}, {1, 0}, {-1, 0}};

        while (!queue.isEmpty()) {
            int[] curr = queue.poll();
            int row = curr[0];
            int col = curr[1];
            int dist = curr[2];

            if (row == endRow && col == endCol) {
                return dist;
            }

            for (int[] dir : directions) {
                int newRow = row + dir[0];
                int newCol = col + dir[1];

                if (newRow >= 0 && newRow < m && newCol >= 0 && newCol < n &&
                        forest.get(newRow).get(newCol) > 0 && !visited[newRow][newCol]) {
                    visited[newRow][newCol] = true;
                    queue.offer(new int[]{newRow, newCol, dist + 1});
                }
            }
        }

        return -1;
    }
}

