public class Solution {
    public boolean solve(int[] cards) {
        Arrays.sort(cards);
        return solveHelper(cards, 0, 24);
    }

    private boolean solveHelper(int[] cards, int index, double target) {
        if (index == cards.length - 1) {
            return Math.abs(cards[index] - target) < 1e-6;
        }

        for (int i = index + 1; i < cards.length; i++) {
            int[] remainingCards = new int[cards.length - 2];
            System.arraycopy(cards, 0, remainingCards, 0, index);
            System.arraycopy(cards, index + 1, remainingCards, index, cards.length - index - 2);

            double[] nums = new double[2];
            nums[0] = cards[index];
            nums[1] = cards[i];

            if (solveWithTwoNumbers(nums, remainingCards, target)) {
                return true;
            }
        }

        return false;
    }

    private boolean solveWithTwoNumbers(double[] nums, int[] remainingCards, double target) {
        double[] expr = new double[2];
        expr[0] = nums[0];
        expr[1] = nums[1];

        if (solveWithOperators(expr, remainingCards, target)) {
            return true;
        }

        return false;
    }

    private boolean solveWithOperators(double[] nums, int[] remainingCards, double target) {
        double a = nums[0];
        double b = nums[1];

        if (Math.abs(a + b - target) < 1e-6) return true;
        if (Math.abs(a - b - target) < 1e-6) return true;
        if (Math.abs(a * b - target) < 1e-6) return true;
        if (b != 0 && Math.abs(a / b - target) < 1e-6) return true;

        return false;
    }
}

