public class Solution {
    public int leastInterval(char[] tasks, int n) {
        Map<Character, Integer> taskCounts = new HashMap<>();
        for (char task : tasks) {
            taskCounts.put(task, taskCounts.getOrDefault(task, 0) + 1);
        }

        PriorityQueue<Integer> maxHeap = new PriorityQueue<>((a, b) -> b - a);
        maxHeap.addAll(taskCounts.values());

        int time = 0;
        while (!maxHeap.isEmpty()) {
            int i = 0;
            int cooldown = n;
            PriorityQueue<Integer> tempQueue = new PriorityQueue<>();

            while (i <= cooldown) {
                if (!maxHeap.isEmpty()) {
                    int count = maxHeap.poll();
                    if (count > 1) {
                        tempQueue.offer(count - 1);
                    }
                }
                time++;
                i++;
                if (maxHeap.isEmpty() && tempQueue.isEmpty()) break;
            }

            while (!tempQueue.isEmpty()) {
                maxHeap.offer(tempQueue.poll());
            }

            if (maxHeap.isEmpty()) break;
            time++;
        }

        return time;
    }
}

