        for (int[] course : courses) {
            int duration = course[0];
            int lastDay = course[1];

            if (currentTime + duration <= lastDay) {
                currentTime += duration;
                pq.offer(duration);
            } else if (!pq.isEmpty() && duration < pq.peek()) {
                if (currentTime - pq.peek() + duration <= lastDay) {
                    currentTime = currentTime - pq.peek() + duration;
                    pq.poll();
                    pq.offer(duration);
                }
            }
        }

        return pq.size();
    }
}

