            } else {
                if (freq.get(num) >= 1 && freq.get(num + 1) >= 1 && freq.get(num + 2) >= 1) {
                    freq.put(num, freq.get(num) - 1);
                    freq.put(num + 1, freq.get(num + 1) - 1);
                    freq.put(num + 2, freq.get(num + 2) - 1);
                    tails.put(num + 2, tails.getOrDefault(num + 2, 0) + 1);
                } else {
                    return false;
                }
            }
        }

        return true;
    }
}

