public class Solution {
    public int minimumCost(int[] price, int[] needs, int[][] special) {
        int n = price.length;
        int[] dp = new int[n + 1];
        for (int i = 1; i <= n; i++) {
            dp[i] = Integer.MAX_VALUE;
        }

        for (int i = 0; i < n; i++) {
            dp[i + 1] = Math.min(dp[i + 1], needs[i] * price[i]);
        }

        for (int[] offer : special) {
            int offerPrice = offer[n];
            for (int i = 0; i < n; i++) {
                int offerQuantity = offer[i];
                if (needs[i] >= offerQuantity) {
                    int remainingNeeds = needs[i] - offerQuantity;
                    int cost = offerPrice;
                    if (remainingNeeds > 0) {
                        cost += remainingNeeds * price[i];
                    }
                    dp[i + 1] = Math.min(dp[i + 1], cost);
                }
            }
        }

        int totalCost = 0;
        for (int i = 0; i < n; i++) {
            totalCost += dp[i + 1];
        }

        return totalCost;
    }
}

