import java.util.Arrays;

public class Solution {
    public boolean canPartitionKSubsets(int[] nums, int k) {
        int sum = 0;
        for (int num : nums) {
            sum += num;
        }

        if (sum % k != 0) {
            return false;
        }

        int target = sum / k;
        int n = nums.length;
        boolean[] visited = new boolean[n];

        Arrays.sort(nums);

        if (nums[n - 1] > target) {
            return false;
        }

        return canPartition(nums, k, 0, 0, target, visited);
    }

    private boolean canPartition(int[] nums, int k, int start, int currentSum, int target, boolean[] visited) {
        if (k == 0) {
            return true;
        }

        if (currentSum == target) {
            return canPartition(nums, k - 1, 0, 0, target, visited);
        }

        for (int i = start; i < nums.length; i++) {
            if (!visited[i] && currentSum + nums[i] <= target) {
                visited[i] = true;
                if (canPartition(nums, k, i + 1, currentSum + nums[i], target, visited)) {
                    return true;
                }
                visited[i] = false;
            }
        }

        return false;
    }
}

