        return res;
    }

    private int getHeight(TreeNode node) {
        if (node == null) {
            return 0;
        }
        return 1 + Math.max(getHeight(node.left), getHeight(node.right));
    }

    private void placeNode(TreeNode node, int row, int col, int height, List<List<String>> res) {
        if (node == null) {
            return;
        }

        res.get(row).set(col, String.valueOf(node.val));

        int nextRow = row + 1;
        int leftCol = col - (int) Math.pow(2, height - row - 1);
        int rightCol = col + (int) Math.pow(2, height - row - 1);

        placeNode(node.left, nextRow, leftCol, height, res);
        placeNode(node.right, nextRow, rightCol, height, res);
    }
}

