import com_github_leetcode.TreeNode;
import java.util.LinkedList;
import java.util.Objects;
import java.util.Queue;

public class Solution {

    public class Solution {
        TreeNode node;
        int idx;

        public Pair(TreeNode node, int idx) {
            this.node = node;
            this.idx = idx;
        }
    }

    public int widthOfBinaryTree(TreeNode root) {
        if (root == null) {
            return 0;
        }

        int maxWidth = 0;
        Queue<Pair> queue = new LinkedList<>();
        queue.offer(new Pair(root, 0));

        while (!queue.isEmpty()) {
            int size = queue.size();
            int first = queue.peek().idx;
            int last = -1;

            for (int i = 0; i < size; i++) {
                Pair current = queue.poll();
                if (current.node != null) {
                    last = current.idx;
                    if (current.node.left != null) {
                        queue.offer(new Pair(current.node.left, 2 * current.idx + 1));
                    } else {
                        queue.offer(new Pair(null, 2 * current.idx + 1));
                    }
                    if (current.node.right != null) {
                        queue.offer(new Pair(current.node.right, 2 * current.idx + 2));
                    } else {
                        queue.offer(new Pair(null, 2 * current.idx + 2));
                    }
                }
            }
            maxWidth = Math.max(maxWidth, last - first + 1);
        }

        return maxWidth;
    }
}

