public class Solution {
    public int maxPoints(int[][] points) {
        if (points == null || points.length == 0) {
            return 0;
        }

        int n = points.length;
        int max = 0;

        for (int i = 0; i < n; i++) {
            Map<Double, Integer> slopeCount = new HashMap<>();
            int duplicatePoints = 1;
            int verticalPoints = 0;

            for (int j = i + 1; j < n; j++) {
                if (points[i][0] == points[j][0] && points[i][1] == points[j][1]) {
                    duplicatePoints++;
                } else if (points[i][0] == points[j][0]) {
                    verticalPoints++;
                } else {
                    double slope = (double) (points[j][1] - points[i][1]) / (points[j][0] - points[i][0]);
                    slopeCount.put(slope, slopeCount.getOrDefault(slope, 0) + 1);
                }
            }

            int currentMax = 0;
            for (int count : slopeCount.values()) {
                currentMax = Math.max(currentMax, count);
            }
            currentMax = Math.max(currentMax, verticalPoints);
            max = Math.max(max, currentMax + duplicatePoints);
        }

        return max;
    }
}

