        }

        return buildTreeHelper(preorder, inorder, inorderIndexMap, 0, inorder.length - 1, 0);
    }

    private TreeNode buildTreeHelper(int[] preorder, int[] inorder, Map<Integer, Integer> inorderIndexMap, int inorderStart, int inorderEnd, int preorderIndex) {
