            return null;
        }

        int rootValue = preorder[preorderIndex];
        TreeNode root = new TreeNode(rootValue);

        int inorderIndex = inorderIndexMap.get(rootValue);

        root.left = buildTreeHelper(preorder, inorder, inorderIndexMap, inorderStart, inorderIndex - 1, preorderIndex + 1);
        root.right = buildTreeHelper(preorder, inorder, inorderIndexMap, inorderIndex + 1, inorderEnd, preorderIndex + 1 + (inorderIndex - inorderStart));

        return root;
    }
