    }

    private TreeNode buildTreeHelper(int[] inorder, int[] postorder, int inorderStart, int inorderEnd, int postorderStart, int postorderEnd, Map<Integer, Integer> inorderIndexMap) {
        if (inorderStart > inorderEnd) {
            return null;
