        int rootValue = postorder[postorderEnd];
        TreeNode root = new TreeNode(rootValue);

        int rootIndexInorder = inorderIndexMap.get(rootValue);

        int leftInorderSize = rootIndexInorder - inorderStart;

        root.left = buildTreeHelper(inorder, postorder, inorderStart, rootIndexInorder - 1, postorderStart, postorderStart + leftInorderSize - 1, inorderIndexMap);
        root.right = buildTreeHelper(inorder, postorder, rootIndexInorder + 1, inorderEnd, postorderStart + leftInorderSize, postorderEnd - 1, inorderIndexMap);

        return root;
    }
