import java.util.Queue;
import java.util.Set;

public class Solution {
    public List<List<String>> findLadders(String beginWord, String endWord, List<String> wordList) {
        List<List<String>> result = new ArrayList<>();
        if (wordList == null || wordList.size() == 0) {
            return result;
        }

        Set<String> wordSet = new HashSet<>(wordList);
        if (!wordSet.contains(endWord)) {
            return result;
        }

        Map<String, List<String>> graph = new HashMap<>();
        Set<String> visited = new HashSet<>();
        Queue<List<String>> queue = new LinkedList<>();

        queue.offer(List.of(beginWord));
        visited.add(beginWord);

        while (!queue.isEmpty()) {
            List<String> currentPath = queue.poll();
            String lastWord = currentPath.get(currentPath.size() - 1);

            if (lastWord.equals(endWord)) {
                result.add(new ArrayList<>(currentPath));
                continue;
            }

            for (String word : wordList) {
                if (!visited.contains(word) && isOneLetterDiff(lastWord, word)) {
                    List<String> newPath = new ArrayList<>(currentPath);
                    newPath.add(word);
                    queue.offer(newPath);
                    visited.add(word);
                }
            }
        }

        if (result.isEmpty()) {
            return result;
        }

        int shortestLength = Integer.MAX_VALUE;
        for (List<String> path : result) {
            if (path.size() < shortestLength) {
                shortestLength = path.size();
            }
        }

        List<List<String>> shortestPaths = new ArrayList<>();
        for (List<String> path : result) {
            if (path.size() == shortestLength) {
                shortestPaths.add(new ArrayList<>(path));
            }
        }

        return shortestPaths;
    }

    private boolean isOneLetterDiff(String word1, String word2) {
        if (word1.length() != word2.length()) {
            return false;
        }

        int diffCount = 0;
        for (int i = 0; i < word1.length(); i++) {
            if (word1.charAt(i) != word2.charAt(i)) {
                diffCount++;
            }
        }

        return diffCount == 1;
    }
}

