public class Solution {
    public int maximumSum(int[] arr) {
        int n = arr.length;
        int[] left = new int[n];
        int[] right = new int[n];

        left[0] = arr[0];
        int maxSum = arr[0];
        for (int i = 1; i < n; i++) {
            left[i] = Math.max(arr[i], left[i - 1] + arr[i]);
            maxSum = Math.max(maxSum, left[i]);
        }

        right[n - 1] = arr[n - 1];
        for (int i = n - 2; i >= 0; i--) {
            right[i] = Math.max(arr[i], right[i + 1] + arr[i]);
        }

        for (int i = 1; i < n - 1; i++) {
            maxSum = Math.max(maxSum, left[i - 1] + right[i + 1]);
        }

        return maxSum;
    }
}

