public class Solution {
    /**
     * Given the root of a binary tree, each node in the tree has a distinct value.
     * After deleting all nodes with a value in to_delete, we are left with a forest (a disjoint union of trees).
     * Return the roots of the trees in the remaining forest. You may return the result in any order.
     *
     * @param root     The root of the binary tree.
     * @param to_delete The set of values to delete.
     * @return The roots of the trees in the remaining forest.
     */
    public List<TreeNode> deleteNodes(TreeNode root, Set<Integer> to_delete) {
        List<TreeNode> roots = new ArrayList<>();
        deleteNodesHelper(root, to_delete, roots);
        return roots;
    }

    private TreeNode deleteNodesHelper(TreeNode root, Set<Integer> to_delete, List<TreeNode> roots) {
        if (root == null) {
            return null;
        }

        root.left = deleteNodesHelper(root.left, to_delete, roots);
        root.right = deleteNodesHelper(root.right, to_delete, roots);

        if (to_delete.contains(root.val)) {
            return null;
        }

        if (root.left == null && root.right == null) {
            return root;
        }

        return root;
    }
}

