public class Solution {
    public int mctFromLeafValues(int[] arr) {
        int n = arr.length;
        int[][] dp = new int[n][n];

        for (int len = 2; len <= n; len++) {
            for (int i = 0; i <= n - len; i++) {
                int j = i + len - 1;
                dp[i][j] = Integer.MAX_VALUE;
                for (int k = i; k < j; k++) {
                    int leftMax = 0;
                    if (i == k) {
                        leftMax = 0;
                    } else {
                        leftMax = findMax(arr, i, k);
                    }
                    int rightMax = 0;
                    if (k + 1 == j) {
                        rightMax = 0;
                    } else {
                        rightMax = findMax(arr, k + 1, j);
                    }
                    dp[i][j] = Math.min(dp[i][j], dp[i][k] + dp[k + 1][j] + leftMax * rightMax);
                }
            }
        }

        return dp[0][n - 1];
    }

    private int findMax(int[] arr, int start, int end) {
        int maxVal = arr[start];
        for (int i = start + 1; i <= end; i++) {
            maxVal = Math.max(maxVal, arr[i]);
        }
        return maxVal;
    }
}

