import java.util.Arrays;

public class Solution {
    /**
     * Alice and Bob continue their games with piles of stones. There are a number of piles arranged in a row, and each pile has a positive integer number of stones piles[i]. The objective of the game is to end with the most stones. Alice and Bob take turns, with Alice starting first. Initially, M = On each player's turn, that player can take all the stones in the first X remaining piles, where 1 <= X <= 2M. Then, we set M = max(M, X). The game continues until all the stones have been taken. Assuming Alice and Bob play optimally, return the maximum number of stones Alice can get.
     *
     * @param piles The number of stones in each pile.
     * @return The maximum number of stones Alice can get.
     */
    public long stoneGame(int[] piles) {
        int n = piles.length;
        long[][] dp = new long[n][n];
        for (int i = 0; i < n; i++) {
            dp[i][i] = piles[i];
        }

        for (int len = 2; len <= n; len++) {
            for (int i = 0; i <= n - len; i++) {
                int j = i + len - 1;
                dp[i][j] = Math.max(dp[i + 1][j], dp[i][j - 1]);
                int m = Math.max(1, (int) Math.ceil((double) (j - i + 1) / 2));
                long sum = 0;
                for (int k = 0; k < m && i + k <= j; k++) {
                    sum += piles[i + k];
                }
                dp[i][j] = Math.max(dp[i][j], sum + Math.min(dp[i + m][j], dp[i][j - m]));
            }
        }

        long totalSum = 0;
        for (int pile : piles) {
            totalSum += pile;
        }

        return (totalSum + 1) / 2;
    }
}

