public class Solution {
    public int[] smallestSufficientTeam(String[] skills, List<List<String>> people) {
        int n = skills.length;
        int m = people.size();

        int skillMask = 0;
        Map<String, Integer> skillToIndex = new HashMap<>();
        for (int i = 0; i < n; i++) {
            skillToIndex.put(skills[i], i);
            skillMask |= (1 << i);
        }

        int[] dp = new int[skillMask + 1];
        for (int i = 0; i <= skillMask; i++) {
            dp[i] = Integer.MAX_VALUE;
        }
        dp[0] = 0;

        for (int i = 0; i < m; i++) {
            int personMask = 0;
            for (String skill : people.get(i)) {
                personMask |= (1 << skillToIndex.get(skill));
            }

            for (int j = skillMask; j >= 0; j--) {
                if (dp[j] != Integer.MAX_VALUE) {
                    int nextMask = j | personMask;
                    dp[nextMask] = Math.min(dp[nextMask], dp[j] + 1);
                }
            }
        }

        int[] result = new int[dp[skillMask]];
        int currentMask = skillMask;
        int index = 0;
        for (int i = m - 1; i >= 0; i--) {
            int personMask = 0;
            for (String skill : people.get(i)) {
                personMask |= (1 << skillToIndex.get(skill));
            }

            if ((currentMask & personMask) != 0) {
                result[index++] = i;
                currentMask ^= personMask;
            }
        }

        return result;
    }
}

