        int[] score = new int[n];
        for (int i = 0; i < n; i++) {
            score[i] = hours[i] - 8;
        }

        int[] prefixSum = new int[n + 1];
        for (int i = 0; i < n; i++) {
            prefixSum[i + 1] = prefixSum[i] + score[i];
        }

        int maxLength = 0;
        HashMap<Integer, Integer> firstOccurrence = new HashMap<>();

        for (int i = 0; i <= n; i++) {
            if (!firstOccurrence.containsKey(prefixSum[i])) {
                firstOccurrence.put(prefixSum[i], i);
            }

            if (prefixSum[i] < 0) {
                if (firstOccurrence.containsKey(-prefixSum[i])) {
                    maxLength = Math.max(maxLength, i - firstOccurrence.get(-prefixSum[i]));
                }
            } else {
                if (firstOccurrence.containsKey(prefixSum[i])) {
                    maxLength = Math.max(maxLength, i - firstOccurrence.get(prefixSum[i]));
                }
            }
        }

        return maxLength;
    }
}

