import java.util.logging.Level;
import java.util.logging.Logger;

public class Solution {
    public boolean parseBoolExpr(String expression) {
        return parse(expression, 0)[0];
    }

    private Object[] parse(String expression, int index) {
        if (expression.charAt(index) == 't') {
            return new Object[]{true, index + 1};
        } else if (expression.charAt(index) == 'f') {
            return new Object[]{false, index + 1};
        } else if (expression.charAt(index) == '!') {
            Object[] inner = parse(expression, index + 1);
            boolean value = (Boolean) inner[0];
            int nextIndex = (Integer) inner[1];
            return new Object[]{!value, nextIndex};
        } else if (expression.charAt(index) == '&') {
            List<Boolean> values = new ArrayList<>();
            int nextIndex = index + 1;
            while (nextIndex < expression.length() && expression.charAt(nextIndex) != ')') {
                Object[] inner = parse(expression, nextIndex);
                values.add((Boolean) inner[0]);
                nextIndex = (Integer) inner[1];
            }
            boolean result = true;
            for (boolean value : values) {
                result &= value;
            }
            return new Object[]{result, nextIndex + 1};
        } else if (expression.charAt(index) == '|') {
            List<Boolean> values = new ArrayList<>();
            int nextIndex = index + 1;
            while (nextIndex < expression.length() && expression.charAt(nextIndex) != ')') {
                Object[] inner = parse(expression, nextIndex);
                values.add((Boolean) inner[0]);
                nextIndex = (Integer) inner[1];
            }
            boolean result = false;
            for (boolean value : values) {
                result |= value;
            }
            return new Object[]{result, nextIndex + 1};
        } else {
            return new Object[]{false, index + 1};
        }
    }
}

