import java.util.Arrays;

public class Solution {
    /**
     * You have n dice and each die has k faces numbered from 1 to k.
     * Given three integers n, k, and target, return the number of possible ways (out of the k^n total ways)
     * to roll the dice so the sum of the face-up numbers equals target.
     * Since the answer may be too large, return it modulo 10^9 + 7.
     *
     * @param n     The number of dice.
     * @param k     The number of faces on each die.
     * @param target The target sum.
     * @return The number of possible ways to roll the dice so the sum of the face-up numbers equals target, modulo 10^9 + 7.
     */
    public int numWays(int n, int k, int target) {
        int MOD = 1000000007;
        int[][] dp = new int[n + 1][target + 1];
        dp[0][0] = 1;

        for (int i = 1; i <= n; i++) {
            for (int j = 1; j <= target; j++) {
                for (int face = 1; face <= k; face++) {
                    if (j >= face) {
                        dp[i][j] = (dp[i][j] + dp[i - 1][j - face]) % MOD;
                    }
                }
            }
        }

        return dp[n][target];
    }
}

