            counts.put(key1, counts.getOrDefault(key1, 0) + 1);
            counts.put(key2, counts.getOrDefault(key2, 0) + 1);
        }

        for (int count : counts.values()) {
            pairs += count * (count - 1) / 2;
        }

        return pairs;
    }
