public class Solution {
    public int numPrimeArrangements(int n) {
        int primes = 0;
        for (int i = 2; i <= n; i++) {
            if (isPrime(i)) {
                primes++;
            }
        }

        long result = factorial(primes);
        return (int) (result % 1000000007);
    }

    private boolean isPrime(int n) {
        if (n <= 1) {
            return false;
        }
        for (int i = 2; i * i <= n; i++) {
            if (n % i == 0) {
                return false;
            }
        }
        return true;
    }

    private long factorial(int n) {
        long result = 1;
        for (int i = 1; i <= n; i++) {
            result = (result * i) % 1000000007;
        }
        return result;
    }
}

