public class Solution {
    public int kConcatenationMaxSum(int[] arr, int k) {
        long maxSum = 0;
        long kadaneSum = kadane(arr);
        long totalSum = 0;

        for (int num : arr) {
            totalSum += num;
        }

        if (k == 1) {
            maxSum = kadaneSum;
        } else {
            if (totalSum > 0) {
                maxSum = (kadaneSum + (long)totalSum * (long)(k - 1));
            } else {
                maxSum = kadaneSum;
            }
            maxSum %= 1000000007;
        }

        return (int)maxSum;
    }

    private long kadane(int[] arr) {
        long maxSoFar = 0;
        long currentMax = 0;

        for (int num : arr) {
            currentMax += num;
            if (currentMax < 0) {
                currentMax = 0;
            }
            maxSoFar = Math.max(maxSoFar, currentMax);
        }
        if(maxSoFar == 0){
            maxSoFar = Integer.MIN_VALUE;
            for(int num : arr){
                maxSoFar = Math.max(maxSoFar, num);
            }
        }
        return maxSoFar;
    }
}

