public class Solution {
    public TreeNode lcaDeepestLeaves(TreeNode root) {
        return lcaDeepestLeavesHelper(root, new int[]{0});
    }

    private TreeNode lcaDeepestLeavesHelper(TreeNode root, int[] depth) {
        if (root == null) {
            return null;
        }

        int leftDepth = depth[0];
        TreeNode leftLCA = lcaDeepestLeavesHelper(root.left, depth);

        int rightDepth = depth[0];
        TreeNode rightLCA = lcaDeepestLeavesHelper(root.right, depth);

        if (leftLCA == null && rightLCA == null) {
            depth[0] = 1;
            return root;
        } else if (leftLCA == null) {
            depth[0] = rightDepth + 1;
            return rightLCA;
        } else if (rightLCA == null) {
            depth[0] = leftDepth + 1;
            return leftLCA;
        } else {
            if (leftDepth == rightDepth) {
                depth[0] = leftDepth + 1;
                return root;
            } else if (leftDepth > rightDepth) {
                depth[0] = leftDepth + 1;
                return leftLCA;
            } else {
                depth[0] = rightDepth + 1;
                return rightLCA;
            }
        }
    }
}

