        for (String transactionStr : transactions) {
            String[] parts = transactionStr.split(",");
            String name = parts[0];
            int time = Integer.parseInt(parts[1]);
            double amount = Double.parseDouble(parts[2]);
            String city = parts[3];

            Transaction transaction = new Transaction(name, time, amount, city);

            transactionsByNameAndCity.computeIfAbsent(name, k -> new ArrayList<>()).add(transaction);
        }

        for (String name : transactionsByNameAndCity.keySet()) {
            List<Transaction> transactionList = transactionsByNameAndCity.get(name);
            for (int i = 0; i < transactionList.size(); i++) {
                Transaction currentTransaction = transactionList.get(i);
                if (currentTransaction.amount > 1000) {
                    invalidTransactions.add(currentTransaction.getTransactionString());
