public class Solution {
    public List<Integer> pathInZigZagTree(int label) {
        List<Integer> path = new LinkedList<>();
        int row = 1;
        int totalNodes = 0;

        while (label > 0) {
            path.add(0, label);
            int nodesInRow = (int) Math.pow(2, row) - 1;
