public class Solution {
    public int largest1BorderedSquare(int[][] grid) {
        if (grid == null || grid.length == 0 || grid[0].length == 0) {
            return 0;
        }

        int rows = grid.length;
        int cols = grid[0].length;
        int maxSize = 0;

        for (int row = 0; row < rows; row++) {
            for (int col = 0; col < cols; col++) {
                if (grid[row][col] == 1) {
                    int size = 0;
                    while (row + size < rows && col + size < cols) {
                        boolean bordered = true;

                        // Check top border
                        for (int i = col; i <= col + size; i++) {
                            if (grid[row][i] == 0) {
                                bordered = false;
                                break;
                            }
                        }
                        if (!bordered) {
                            break;
                        }

                        // Check bottom border
                        for (int i = col; i <= col + size; i++) {
                            if (grid[row + size][i] == 0) {
                                bordered = false;
                                break;
                            }
                        }
                        if (!bordered) {
                            break;
                        }

                        // Check left border
                        for (int i = row; i <= row + size; i++) {
                            if (grid[i][col] == 0) {
                                bordered = false;
                                break;
                            }
                        }
                        if (!bordered) {
                            break;
                        }

                        // Check right border
                        for (int i = row; i <= row + size; i++) {
                            if (grid[i][col + size] == 0) {
                                bordered = false;
                                break;
                            }
                        }
                        if (!bordered) {
                            break;
                        }

                        if (bordered) {
                            size++;
                        } else {
                            break;
                        }
                    }
                    maxSize = Math.max(maxSize, size);
                }
            }
        }

        return maxSize;
    }
}

