import java.util.ArrayList;
import java.util.Arrays;
import java.util.LinkedList;
import java.util.List;
import java.util.Queue;

public class Solution {
    public int[] shortestAlternatingPaths(int n, int[][] redEdges, int[][] blueEdges) {
        List<List<Pair>> adj = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            adj.add(new ArrayList<>());
        }

        for (int[] edge : redEdges) {
            adj.get(edge[0]).add(new Pair(edge[1], 0)); // 0 for red
        }
        for (int[] edge : blueEdges) {
            adj.get(edge[0]).add(new Pair(edge[1], 1)); // 1 for blue
        }

        int[] dist = new int[n];
        Arrays.fill(dist, -1);
        dist[0] = 0;

        Queue<int[]> q = new LinkedList<>();
        q.offer(new int[]{0, -1}); // {node, color} -1 means no color yet

        boolean[][] visited = new boolean[n][2]; // visited[node][color]
        visited[0][0] = true;
        visited[0][1] = true;

        while (!q.isEmpty()) {
            int[] curr = q.poll();
            int node = curr[0];
            int color = curr[1];

            for (Pair neighbor : adj.get(node)) {
                int nextNode = neighbor.node;
                int nextColor = neighbor.color;

                if (nextColor != color && !visited[nextNode][nextColor]) {
                    visited[nextNode][nextColor] = true;
                    if (dist[nextNode] == -1) {
                        dist[nextNode] = dist[node] + 1;
                    }
                    q.offer(new int[]{nextNode, nextColor});
                }
            }
        }

        return dist;
    }

    private static class Pair {
        int node;
        int color;

        public Pair(int node, int color) {
            this.node = node;
            this.color = color;
        }
    }
}

