public class Solution {
    public ListNode removeZeroSumSublists(ListNode head) {
        ListNode dummy = new ListNode(0);
        dummy.next = head;
        Map<Integer, ListNode> map = new HashMap<>();
        map.put(0, dummy);
        int sum = 0;
        ListNode curr = head;
        while (curr != null) {
            sum += curr.val;
            if (map.containsKey(sum)) {
                ListNode prev = map.get(sum);
                ListNode start = prev.next;
                int tempSum = sum;
                while (start != curr) {
                    tempSum += start.val;
                    start = start.next;
                    map.remove(tempSum);
                }
                prev.next = curr.next;
            } else {
                map.put(sum, curr);
            }
            curr = curr.next;
        }
        return dummy.next;
    }
}

