public class Solution {
    public int longestDecomposition(String text) {
        int n = text.length();
        if (n == 0) {
            return 0;
        }

        int k = 0;
        int left = 0;
        int right = n - 1;

        while (left <= right) {
            int len = 1;
            while (left + len - 1 < right - len + 1) {
                if (text.substring(left, left + len).equals(text.substring(right - len + 1, right + 1))) {
                    k += 2;
                    left += len;
                    right -= len;
                    break;
                }
                len++;
            }
            if (left > right) {
                break;
            }
            if (left == right) {
                k += 1;
                break;
            }
        }

        return k;
    }
}

