import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;

public class Solution {
    public List<List<Integer>> criticalConnections(int n, List<List<Integer>> connections) {
        List<List<Integer>> graph = new ArrayList<>();
        for (int i = 0; i < n; i++) {
            graph.add(new ArrayList<>());
        }
        for (List<Integer> connection : connections) {
            int u = connection.get(0);
            int v = connection.get(1);
            graph.get(u).add(v);
            graph.get(v).add(u);
        }

        int[] disc = new int[n];
        int[] low = new int[n];
        int[] parent = new int[n];
        boolean[] visited = new boolean[n];
        List<List<Integer>> criticalConnections = new ArrayList<>();
        int time = 0;

        for (int i = 0; i < n; i++) {
            parent[i] = -1;
            visited[i] = false;
        }

        for (int i = 0; i < n; i++) {
            if (!visited[i]) {
                dfs(i, graph, visited, disc, low, parent, criticalConnections, time);
            }
        }

        return criticalConnections;
    }

    private void dfs(int u, List<List<Integer>> graph, boolean[] visited, int[] disc, int[] low, int[] parent, List<List<Integer>> criticalConnections, int time) {
        visited[u] = true;
        disc[u] = low[u] = ++time;

        for (int v : graph.get(u)) {
            if (!visited[v]) {
                parent[v] = u;
                dfs(v, graph, visited, disc, low, parent, criticalConnections, time);

                low[u] = Math.min(low[u], low[v]);

                if (low[v] > disc[u]) {
                    List<Integer> connection = new ArrayList<>();
                    connection.add(u);
                    connection.add(v);
                    criticalConnections.add(connection);
                }
            } else if (v != parent[u]) {
                low[u] = Math.min(low[u], disc[v]);
            }
        }
    }
}

