public class Solution {
    public int minNonZeroProduct(int p) {
        long mod = 1000000007;
        if (p == 1) {
            return 1;
        }
        if (p == 2) {
            return 1;
        }

        long product = 1;
        for (int i = 1; i <= p - 1; i++) {
            product = (product * i) % mod;
        }

        if (product == 0) {
            return 0;
        }

        return (int) (product % (mod - 1));
    }
}

