public class Solution {
    public int numberOfWeakCharacters(int[][] properties) {
        int n = properties.length;
        int[][] sortedProperties = new int[n][2];
        for (int i = 0; i < n; i++) {
            sortedProperties[i] = properties[i];
        }

        Arrays.sort(sortedProperties, (a, b) -> {
            if (a[0] != b[0]) {
                return b[0] - a[0];
            } else {
                return b[1] - a[1];
            }
        });

        int weakCount = 0;
        int maxDefense = 0;

        for (int i = 0; i < n; i++) {
            if (sortedProperties[i][1] < maxDefense) {
                weakCount++;
            } else {
                maxDefense = sortedProperties[i][1];
            }
        }

        return weakCount;
    }
}

