public class Solution {
    public boolean canBeIncreasing(int[] nums) {
        int n = nums.length;
        int count = 0;
        int index = -1;

        for (int i = 1; i < n; i++) {
            if (nums[i - 1] >= nums[i]) {
                count++;
                index = i;
            }
        }

        if (count == 0) {
            return true;
        }

        if (count > 1) {
            return false;
        }

        if (index == 0 || index == n - 1) {
            return true;
        }

        if (nums[index - 1] < nums[index + 1] || nums[index - 1] < nums[index]) {
            return true;
        }

        return false;
    }
}

