import java.security.SecureRandom;
import java.util.Arrays;
import java.util.Random;

public class Solution {
    public int[] rearrangeArray(int[] nums) {
        Arrays.sort(nums);
        int n = nums.length;
        int[] rearranged = new int[n];
        int left = 0;
        int right = n - 1;
        int index = 0;

        while (left <= right) {
            if (left == right) {
                rearranged[index++] = nums[left];
                break;
            }

            rearranged[index++] = nums[left];
            rearranged[index++] = nums[right];
            left++;
            right--;
        }

        for (int i = 1; i < n - 1; i++) {
            if ((double)(rearranged[i - 1] + rearranged[i + 1]) / 2 == rearranged[i]) {
                SecureRandom random = new SecureRandom();
                int swapIndex = random.nextInt(n);
                int temp = rearranged[i];
                rearranged[i] = rearranged[swapIndex];
                rearranged[swapIndex] = temp;
            }
        }

        return rearranged;
    }
}

