public class Solution {
    public int eliminateMaximum(int[] dist, int[] speed) {
        int n = dist.length;
        double[] timeToReach = new double[n];
        for (int i = 0; i < n; i++) {
            timeToReach[i] = (double) dist[i] / speed[i];
        }

        PriorityQueue<Double> pq = new PriorityQueue<>();
        for (double time : timeToReach) {
            pq.offer(time);
        }

        int eliminated = 0;
        int currentTime = 0;
        while (!pq.isEmpty()) {
            double time = pq.poll();
            if (time > currentTime) {
                eliminated++;
                currentTime = time + 1;
            } else {
                break;
            }
        }

        return eliminated;
    }
}

