public class Solution {
    public long maxMatrixSum(int[][] matrix) {
        int n = matrix.length;
        long sum = 0;
        int[][] copy = new int[n][n];
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                copy[i][j] = matrix[i][j];
            }
        }

        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                if (copy[i][j] < 0) {
                    if (i + 1 < n) {
                        copy[i][j] *= -1;
                        copy[i + 1][j] *= -1;
                    } else if (j + 1 < n) {
                        copy[i][j] *= -1;
                        copy[i][j + 1] *= -1;
                    }
                }
            }
        }

        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                sum += copy[i][j];
            }
        }

        return sum;
    }
}

