import java.util.Stack;

public class Solution {
    public int minSwaps(String s) {
        int n = s.length();
        Stack<Character> stack = new Stack<>();
        int swaps = 0;
        int mismatch = 0;

        for (int i = 0; i < n; i++) {
            if (s.charAt(i) == '[') {
                stack.push(s.charAt(i));
            } else {
                if (!stack.isEmpty()) {
                    stack.pop();
                } else {
                    mismatch++;
                }
            }
        }

        swaps = (mismatch + 1) / 2;
        return swaps;
    }
}

