public class Solution {
    public int[][] rotateGrid(int[][] grid, int k) {
        int m = grid.length;
        int n = grid[0].length;
        k = k % (m * n);

        for (int layer = 0; layer < m / 2; layer++) {
            for (int rotation = 0; rotation < k; rotation++) {
                int[] temp = new int[m * n];
                int layerSize = n - 2 * layer;
                int index = 0;

                for (int i = layer; i < m - layer; i++) {
                    for (int j = layer; j < n - layer; j++) {
                        temp[index++] = grid[i][j];
                    }
                }

                index = 0;
                for (int i = layer; i < m - layer; i++) {
                    for (int j = layer; j < n - layer; j++) {
                        grid[i][j] = temp[index++];
                    }
                }

                int[] rotatedTemp = new int[m * n];
                index = 0;
                for (int i = layer; i < m - layer; i++) {
                    for (int j = layer; j < n - layer; j++) {
                        rotatedTemp[index++] = grid[i][j];
                    }
                }

                index = 0;
                for (int i = 0; i < m; i++) {
                    for (int j = 0; j < n; j++) {
                        if (i == layer && j == layer) {
                            continue;
                        }
                    }
                }

                int[] prevLayer = new int[m * n];
                index = 0;
                for (int i = layer; i < m - layer; i++) {
                    for (int j = layer; j < n - layer; j++) {
                        prevLayer[index++] = grid[i][j];
                    }
                }

                index = 0;
                for (int i = layer; i < m - layer; i++) {
                    for (int j = layer; j < n - layer; j++) {
                        if (index == 0) {
                            grid[i][j] = prevLayer[index++];
                        } else {
                            grid[i][j] = prevLayer[index++];
                        }
                    }
                }
            }
        }

        return grid;
    }
}

