import java.util.Arrays;

public class Solution {
    public int maxCompatibilitySum(int[][] students, int[][] mentors) {
        int n = students.length;
        int maxScore = 0;

        // Generate all possible permutations of mentor assignments
        int[] permutation = new int[n];
        for (int i = 0; i < n; i++) {
            permutation[i] = i;
        }

        do {
            int currentScore = 0;
            for (int i = 0; i < n; i++) {
                currentScore += calculateCompatibility(students[i], mentors[permutation[i]]);
            }
            maxScore = Math.max(maxScore, currentScore);
        } while (nextPermutation(permutation));

        return maxScore;
    }

    private int calculateCompatibility(int[] student, int[] mentor) {
        int score = 0;
        for (int i = 0; i < student.length; i++) {
            if (student[i] == mentor[i]) {
                score++;
            }
        }
        return score;
    }

    private boolean nextPermutation(int[] arr) {
        int i = arr.length - 2;
        while (i >= 0 && arr[i] >= arr[i + 1]) {
            i--;
        }
        if (i == -1) {
            return false;
        }
        int j = arr.length - 1;
        while (arr[j] <= arr[i]) {
            j--;
        }
        int temp = arr[i];
        arr[i] = arr[j];
        arr[j] = temp;
        int start = i + 1;
        int end = arr.length - 1;
        while (start < end) {
            int temp2 = arr[start];
            arr[start] = arr[end];
            arr[end] = temp2;
            start++;
            end--;
        }
        return true;
    }
}

