public class Solution {
    public int[] longestObstacleCourseAtEachPosition(int[] obstacles) {
        int n = obstacles.length;
        int[] ans = new int[n];

        for (int i = 0; i < n; i++) {
            int maxLength = 0;
            for (int j = 0; j <= i; j++) {
                boolean valid = true;
                if (j > 0) {
                    for (int k = j; k < i; k++) {
                        if (obstacles[k] > obstacles[k + 1]) {
                            valid = false;
                            break;
                        }
                    }
                }
                if (valid) {
                    maxLength = Math.max(maxLength, i - j + 1);
                }
            }
            ans[i] = maxLength;
        }

        return ans;
    }
}

