public class Solution {
    public int[] findPeakGrid(int[][] mat) {
        int m = mat.length;
        int n = mat[0].length;

        int startCol = 0;
        int endCol = n - 1;

        while (startCol <= endCol) {
            int midCol = startCol + (endCol - startCol) / 2;

            int maxRow = 0;
            for (int i = 0; i < m; i++) {
                if (mat[i][midCol] > mat[maxRow][midCol]) {
                    maxRow = i;
                }
            }

            boolean isPeak = true;

            if (midCol > 0 && mat[maxRow][midCol - 1] > mat[maxRow][midCol]) {
                isPeak = false;
            }
            if (midCol < n - 1 && mat[maxRow][midCol + 1] > mat[maxRow][midCol]) {
                isPeak = false;
            }

            if (isPeak) {
                return new int[]{maxRow, midCol};
            } else if (midCol > 0 && mat[maxRow][midCol - 1] > mat[maxRow][midCol]) {
                endCol = midCol - 1;
            } else {
                startCol = midCol + 1;
            }
        }

        return new int[]{-1, -1};
    }
}

